(1, '2016-05-11 15:36:13', 'Perbandingan Merk Cat Termurah', 'perbandingan-merk-cat-termurah', 'toko cat, toko cat bali, toko cat denpasar, toko cat ubud, cat tembok, weldon, harga cat, jual cat', 'Murah, mewah, meriah, dan kalau bisa ada kembaliannya.. Tentunya produk tersebut akan sangat diminati dong ya.. :D Di postingan kali ini kita akan melihat perbandingan harga produk-produk yang kami miliki, supaya kita bisa memilih produk yang diinginkan d', '<p>Murah, mewah, meriah, dan kalau bisa ada kembaliannya.. Tentunya produk tersebut akan sangat diminati dong ya.. :D Di postingan kali ini kita akan melihat perbandingan harga produk-produk yang kami miliki, supaya kita bisa memilih produk yang diinginkan dengan lebih mudah.</p>\r\n\r\n<ol>\r\n	<li><strong>Cat Tembok Interior</strong>&nbsp;<br />\r\n	-&nbsp;Weldon&nbsp;kemasan 1kg : Rp 27.500, kemasan galon 5kg :&nbsp;<strong>Rp 95.000</strong>, kemasan pail 25kg :&nbsp;<strong>Rp 450.000</strong><br />\r\n	-&nbsp;Envi&nbsp;kemasan 1kg :&nbsp;<strong>Rp 26.500</strong>, kemasan galon 5kg : Rp 100.000, kemasan pail 25kg : Rp 475.000<br />\r\n	-&nbsp;Vinilex&nbsp;kemasan galon 5kg: Rp 98.000, kemasan pail 25kg : Rp 470.000&nbsp;<br />\r\n	&nbsp;</li>\r\n	<li><strong>Cat Tembok Eksterior</strong>&nbsp;<br />\r\n	-&nbsp;Paladin Gold&nbsp;kemasan 2,5 liter :&nbsp;<strong>Rp 215.000</strong>, kemasan pail 20 liter : Rp 1.550.000<br />\r\n	-&nbsp;Belazo EF&nbsp;kemasan 2,5 liter : Rp 219.000, kemasan pail 20 liter : Rp 1.728.000<br />\r\n	-&nbsp;Dulux Weathershield Pro&nbsp;2,5 liter : Rp 219.000*, kemasan pail 20 liter (warna brilliant white) :&nbsp;<strong>Rp 1.540.000*</strong><br />\r\n	-&nbsp;Mowilex Weathercoat&nbsp;kemasan 2,5 liter : Rp 216.500*, kemasan pail 20 liter : Rp 1.618.000*&nbsp;<br />\r\n	<em>Note * : Cat tembok eksterior yang kisaran harganya cukup variatif, karena kebanyakan produk di kategori ini menggunakan warna mixing. Harga yang tercantum merupakan harga cat warna ready stok yang paling murah.</em>&nbsp;<br />\r\n	&nbsp;</li>\r\n	<li><strong>Cat Kayu Besi</strong>&nbsp;<br />\r\n	-&nbsp;Envilux&nbsp;kemasan&nbsp;<strong>1kg : Rp 50.000</strong>, kemasan 3,78kg : Rp 197.000<br />\r\n	-&nbsp;Ocean Gloss&nbsp;kemasan 0,8 liter : Rp 34.200<br />\r\n	-&nbsp;Danalac&nbsp;kemasan 0,9 liter :&nbsp;<strong>Rp 32.500*</strong><br />\r\n	-&nbsp;Emco&nbsp;kemasan 0,5 kg :&nbsp;<strong>Rp 27.500**</strong>, kemasan 1 kg : Rp 61.000**<br />\r\n	-&nbsp;Avian&nbsp;kemasan 0,5 kg : Rp 29.000, kemasan 1 kg : Rp 51.000&nbsp;<br />\r\n	<em>Note * : HARGA PROMO!! Stok terbatas. - ** : Produk dengan kisaran harga yang variatif. Harga yang tercantum adalah harga cat dengan warna termurah.</em>&nbsp;<br />\r\n	&nbsp;</li>\r\n	<li><strong>Cat Genteng</strong>&nbsp;<br />\r\n	-&nbsp;Danaroof&nbsp;kemasan 3,8 liter :&nbsp;<strong>Rp 95.000*</strong><br />\r\n	-&nbsp;Ocean Roof&nbsp;kemasan 3,8 liter : Rp 122.500<br />\r\n	-&nbsp;Envi Roof Paint&nbsp;kemasan 4 kg : Rp 153.000&nbsp;<br />\r\n	<em>Note * : HARGA PROMO!! Stok terbatas.</em>&nbsp;<br />\r\n	&nbsp;</li>\r\n	<li><strong>Waterproof</strong>&nbsp;<br />\r\n	-&nbsp;NoDrop&nbsp;kemasan 1kg :&nbsp;<strong>Rp 41.700</strong>, kemasan galon 4kg :&nbsp;<strong>Rp 158.000</strong>, kemasan pail 20kg :&nbsp;<strong>Rp 723.400</strong><br />\r\n	-&nbsp;Aquaproof&nbsp;kemasan 1kg : Rp 42.000, kemasan galon 4kg : Rp 158.500, kemasan pail 20kg : Rp 726.000<br />\r\n	-&nbsp;WelProof&nbsp;kemasan 1 kg : Rp 44.000, kemasan galon 4 kg : Rp 167.000, kemasan pail 20kg : Rp 750.000&nbsp;<br />\r\n	&nbsp;</li>\r\n	<li><strong>Plamir</strong>&nbsp;<br />\r\n	-&nbsp;Pillar&nbsp;kemasan 1 kg : Rp 13.500, kemasan galon 5kg : Rp 46.000, kemasan pail 25kg : Rp 220.500<br />\r\n	-&nbsp;Tartar&nbsp;kemasan 1 kg : Rp 12.500, kemasan galon 5 kg : Rp 37.500, kemasan pail 25 kg : Rp 162.500&nbsp;</li>\r\n</ol>\r\n\r\n<p>Demikian sebagian perbandingan harga produk yang dapat kami tampilkan.. Sebagai catatan, harga yang ditampilkan di halaman ini dapat berubah suatu saat nanti.. Karena itu tidak ada salahnya kita cek harga dan stok produk Citra Warna disini sebelum membelinya.&nbsp;</p>\r\n', 1, 'coba3.jpg', 1, 23),
(2, '2018-05-28 11:43:58', 'Merk Cat Tembok berdasarkan Kebutuhan', 'merk-cat-tembok-berdasarkan-kebutuhan', 'toko cat, toko cat bali, toko cat denpasar', 'Ingin beli cat tembok, tapi nggak tahu merk apa yang harus dibeli sesuai kebutuhan. Memang hal itu sangat wajar, berhubung merk cat ada sangat banyak, dan spesifikasinya juga bermacam-macam tergantung kebutuhan Anda. Karena itu, saat ini kami akan membant', '<p>Ingin beli cat tembok, tapi nggak tahu merk apa yang harus dibeli sesuai kebutuhan. Memang hal itu sangat wajar, berhubung merk cat ada sangat banyak, dan spesifikasinya juga bermacam-macam tergantung kebutuhan Anda. Karena itu, saat ini kami akan membantu mengkategorikan cat yang anda perlukan berdasarkan kategori umum yang ada.</p>\r\n\r\n<ul>\r\n	<li><strong>Cat Untuk Luar Rumah (Eksterior)</strong>. Jika anda mencari cat untuk luar ruangan, sangat disarankan untuk memilih cat tembok eksterior, karena cat tembok eksterior memiliki daya tahan yang jauh lebih tinggi dari cat tembok interior. Memang harganya lebih mahal daripada tembok interior, tapi hasil yang diberikan juga jauh lebih memuaskan. Produk di kategori ini antara lain : Paladin Gold, Belazo EF, Dulux Weathershield, dan Mowilex Weathercoat.</li>\r\n	<li><strong>Cat untuk Dalam Rumah (Interior), Kualitas Premium</strong>. Cat untuk dalam rumah tidak semahal cat untuk luar rumah, karena tidak terlalu memperhatikan daya tahan seperti cat tembok eksterior. Sekalipun begitu, cat tembok dengan kualitas premium tetap memiliki kapasitas yang sangat baik sebagai cat tembok. Produk di kategori ini antara lain : Paladin Silver, Belazo ME, Dulux Pentalite dan Mowilex Emulsion.</li>\r\n	<li><strong>Cat Tembok Interior Oke dengan Harga Standar</strong>. Cat Tembok Interior dengan harga standar ini bukan berarti tidak lebih bagus dari cat yang lainnya, akan tetapi berusaha memberikan cat yang baik dengan harga yang mudah dijangkau masyarakat. Sangat banyak produk yang kami tawarkan di kategori ini: Weldon Wallpaint, Envi Wallpaint, Viniliex dan Dulux Catylac.</li>\r\n	<li><strong>Cat dengan Harga Ekonomis</strong>. Cat tembok satu ini menawarkan harga yang sangat murah dan terjangkau. Memiliki pilihan warna yang cukup banyak, tapi tetap diperhitungkan sebagai cat tembok yang baik. Produk yang kami tawarkan yaitu, Pillar Cat Tembok, Mawar</li>\r\n	<li><strong>Cat Tembok Anti Air (Waterproof)</strong>. Cat tembok anti air adalah cat tembok yang diaplikasikan di luar ruangan, yang berguna supaya tembok kita tidak bocor. produk dalam kategori ini antara lain&nbsp;Welproof,&nbsp;Top Seal,&nbsp;Aquaproof,&nbsp;No Drop</li>\r\n	<li><strong>Cat yang tidak Berbau Racun</strong>. Pada umumnya, rumah yang baru dicat memiliki bau yang tidak begitu enak dan berbahaya jika terlalu lama menghirup ruangan yang baru dicat. Wajar saja, karena pada umumnya cat tembok dibuat dengan bahan kimia yang demikian. Akan tetapi, ada cat tembok yang menawarkan hasil yang optimal, harga yang murah, dan tidak berbau. Cat tersebut adalah&nbsp;Envi. Tidak cuma baunya yang tidak beracun, Envi bahkan memberi sensasi keharuman dibandingkan semua cat tembok lainnya. Karena itu, cat tembok ini sangat cocok untuk rumah yang langsung ditempati ketika selesai dicat, maupun untuk memperbarui warna ruangan.</li>\r\n	<li><strong>Cat dengan Kualitas Terjamin dan Harga Murah</strong>. Tentunya setiap kita sangat ingin membeli cat tembok dengan harga yang terjangkau, akan tetapi tetap memberi hasil yang baik. Produk yang kami tawarkan dari spesifikasi ini adalah&nbsp;Weldon Wallpaint. Harganya tidak terlalu mahal, akan tetapi tetap memberikan hasil yang terbaik dengan daya sebar yang luas, dan daya tutup yang baik.</li>\r\n</ul>\r\n', 4, 'cat-cwa.jpg', 1, 338),
(3, '2016-05-11 15:40:43', 'Tips Rumah yang Sehat dan Nyaman', 'tips-rumah-yang-sehat-dan-nyaman', 'toko cat, toko cat bali, toko cat denpasar, toko cat ubud, cat tembok, weldon, harga cat, jual cat', 'Rumah yang sehat adalah rumah yang praktis, tahan lama dan hemat energi, sehingga membuat hidup lebih terjamin, layak, dan mampu menghemat biaya hidup. Membuat rumah anda dengan lingkungannya yang baik, tentunya tidak selalu membutuhkan biaya besar. Pada ', '<p>Rumah yang sehat adalah rumah yang praktis, tahan lama dan hemat energi, sehingga membuat hidup lebih terjamin, layak, dan mampu menghemat biaya hidup. Membuat rumah anda dengan lingkungannya yang baik, tentunya tidak selalu membutuhkan biaya besar. Pada kenyataannya, ada beberapa tips rumah sehat dan nyaman yang dapat menghemat uang, sekaligus memanfaatkan sumber-sumber daya alam yang tersedia untuk keluarga Anda.</p>\r\n\r\n<p>Dengan merancang, merenovasi rumah dengan baik, akan membuat kualitas kehidupan penghuninya dapat ditingkatkan dan biaya hidup dapat lebih ditekan. Berikut ini adalah cara-cara meningkatkan kualitas rumah kita menjadi lebih sehat dan nyaman:</p>\r\n\r\n<ul>\r\n	<li>Buatlah tanaman merambat pada teralis di sekitar bagian luar rumah ( bisa dilakukan pada dinding dan atau pagar serta ruangan kosong di halaman ). Dapat menyejukkan rumah, bahkan menghasilkan makanan.</li>\r\n	<li>Menanam pohon besar sebagai tempat teduh yang produktif. Menyediakan pohon untuk berteduh dapat menyejukkan udara sekitar rumah</li>\r\n	<li>Menyaring sisa air limbah ke tempat penyaringan yang produktif. Setelah itu, air setelah disaring dapat dimanfaatkan kembali untuk menyiram tanaman.</li>\r\n	<li>Membuat ventilasi dan aliran udara dalam rumah yang baik (udara panas naik dan mengalir keluar lewat ventilasi atas dan udara sejuk masuk lewat bawah) untuk menjaga rumah tetap sejuk tanpa keluar biaya yang banyak.</li>\r\n	<li>Menggunakan jaring nyamuk pada ventilasi untuk mencegah nyamuk yang datang dari luar. Jika memungkinkan, dapat dipasang di seluruh bagian ruangan.</li>\r\n	<li>Pastikan letak jendela mendapat sinar dan atau cahaya matahari secara cukup. Karena cahaya matahari dapat mengurangi gangguan mata . Diusahakan memperbanyak cahaya matahari dan seminimal mungkin mengurangi sinar matahari yang masuk secara langsung</li>\r\n	<li>Membuat kolam ikan di sekitar rumah. Hal ini cukup membantu menampung genangan air yang berlebih.</li>\r\n</ul>\r\n\r\n<p>Demikian tips-tips yang dapat kami&nbsp;berikan, semoga tips-tips ini membantu kita memiliki rumah yang lebih sehat dan nyaman dari sebelumnya.</p>\r\n', 2, 'rumah_nyaman.JPG', 1, 99),
(4, '2015-12-29 10:52:27', 'Penyelesaian Masalah : Tembok Berlumut', 'penyelesaian-masalah-:-tembok-berlumut', 'tembok berlumut, lumut pada tembok, cara menghilangkan lumut pada tembok', 'Tentunya sebagian dari kita pernah mengalami, atau setidaknya melihat tembok yang penuh dengan lumut, bukan? Apa penyebabnya tembok kita menjadi berlumut, dan terlihat jorok? Setidaknya ada beberapa alasan, diantaranya:', '<p>Tentunya sebagian dari kita pernah mengalami, atau setidaknya melihat tembok yang penuh dengan lumut, bukan? Apa penyebabnya tembok kita menjadi berlumut, dan terlihat jorok? Setidaknya ada beberapa alasan, diantaranya:</p>\r\n\r\n<ul>\r\n	<li>Pengecatan tembok yang tidak pada waktunya / tembok belum siap dicat karena masih terlalu lembab.</li>\r\n	<li>Tembok masih mengandung banyak zat alkali yang mendukung pertumbuhan lumut / jamur.</li>\r\n	<li>Kualitas cat yang tidak sesuai / terlalu rendah</li>\r\n</ul>\r\n\r\n<p>Jadi, bagaimana solusinya bila tembok kita mengalami hal seperti ini? Berikut adalah solusi yang kami sarankan:</p>\r\n\r\n<ul>\r\n	<li>Kerok dahulu tembok yang bermasalah dengan scraper. Disarankan, pengerokan dilakukan sampai benar-benar habis dan rata, supaya warna cat tidak belang-belang.</li>\r\n	<li>Karena tembok mudah lembab, sangat dianjurkan menggunakan waterproofing seperti&nbsp;Welproof, Top Seal, Aquaproof, No Drop, atau Sika Raintite. Dan tembok berlumut juga harus dilapisi lapisan primer / anti alkali supaya jamur tidak tumbuh. Dan, ada cat tembok yang mampu mengatasi ketiga-tiganya, yaitu&nbsp;Welproof&nbsp;dan&nbsp;Top Seal.</li>\r\n	<li>Warna yang diberikan Welproof dan Top Seal sudah cukup baik, akan tetapi jika kita ingin memberi cat dengan warna lain, atau kita menggunakan Anti Alkali dan Waterproofing secara terpisah, kita dapat menggunakan cat tembok lainnya untuk memberi warna yang indah. Merk cat tembok juga disesuaikan dengan tempat pengecatan kita.<br />\r\n	Jika didalam ruangan, sebaiknya cat yang digunakan adalah cat tembok Interior (Weldon,&nbsp;Envi,&nbsp;Belazo ME,&nbsp;Dulux Pentalite,&nbsp;Vinilex, dsb), dan jika diluar ruangan menggunakan cat tembok Eksterior (Belazo EF, Dulux Weathershield, Mowilex Weathercoat, dsb).</li>\r\n	<li>Jangan hanya melapisi cat dengan 1 lapisan saja supaya warna tembok terlihat lebih kuat, dan tidak cepat pudar. Disarankan melakukan 2 - 3 kali pengecatan, setelah pemberian Anti Alkali dan Anti Air.</li>\r\n</ul>\r\n\r\n<p>Semoga artikel ini membantu kita mengerti dan mampu mengatasi permasalahan tembok yang berlumut.</p>\r\n', 2, 'IMG-20130713-00552.jpg', 1, 108),
(5, '2015-12-29 11:01:19', 'Pembuatan Cat dengan Teknologi Tinting', 'pembuatan-cat-dengan-teknologi-tinting', 'cat tinting, mixing cat,', 'Akhir2 ini di bidang cat sedang keren-kerennya mendengar istilah cat dengan teknologi Tinting. Apakah itu teknologi baru? Seperti apa sih? Apakah Citra Warna menyediakan cat dengan teknologi tinting? Jawabannya, tentu saja IYA. Hari ini pun kami akan memb', '<p>Akhir2 ini di bidang cat sedang keren-kerennya mendengar istilah cat dengan teknologi Tinting. Apakah itu teknologi baru? Seperti apa sih? Apakah&nbsp;<strong>Citra Warna</strong>&nbsp;menyediakan cat dengan teknologi tinting? Jawabannya, tentu saja IYA. Hari ini pun kami akan membahas tentang bagaimana cara pembuatannya.</p>\r\n\r\n<p>Memilih cat teknologi tinting ini adalah keputusan yang sangat tepat, jika stok warna yang kita inginkan di warna&nbsp;<em>ready stock</em>&nbsp;sedang tidak ada. Karena itu, mari kita lihat bagaimana proses pembuatannya.</p>\r\n\r\n<p>Pertama-tama, tentunya anda sebagai customer datang ke outlet kami, memilih merk cat tinting yang anda inginkan. Memang tidak semua merk cat menyediakan teknologi tinting, tapi kami menyediakan merk-merk berkualitas seperti Dulux, Envi, Mowilex, Kem-Tone, Danapaint, dan sebagainya.</p>\r\n\r\n<p>Setelah anda memilih merk cat tinting, Anda tinggal memilih warna yang anda inginkan di kartu warna. Masing-masing warna memiliki kode uniknya tersendiri, yang sebaiknya anda catat&nbsp;jika kedepannya anda ingin membuat cat dengan kode warna yang sama.</p>\r\n\r\n<p>Setelah anda memilih warna, karyawan kami akan mulai mengerjakannya dengan menyediakan segala keperluan yang diperlukan, seperti cat warna Base (cat warna dasar yang akan diberikan tambahan warna lainnya), tuas untuk membuka tutup cat, cat tinter (cat campuran yang akan dicampurkan ke cat dasar tadi untuk memberi warna), dan sebagainya.</p>\r\n\r\n<p>Setelah itu, stok cat warna dasar Base tadi akan akan dicampurkan dengan warna-warna lainnya di mesin pencampuran seperti gambar disamping. Setiap warna unik yang anda pilih memiliki formula campurannya tersendiri supaya menjadi warna yang anda inginkan. Disinilah warna cat dasar Base tadi akan ditambahkan supaya warnanya menjadi seperti yang anda inginkan.</p>\r\n\r\n<p>Tidak cuma sampai disitu saja, setelah warna-warna yang diperlukan dimasukkan dari mesin tersebut ke cat yang anda pesan, langkah terakhirnya adalah memasukkan cat tersebut ke mesin pengaduk. Tujuannya adalah supaya cat-cat bisa tercampur dengan rata setelah diberi warna tadi. Setelah kita melihat cara pembuatannya ini, apa yang membedakan cat warna biasa (<em>ready stock</em>) dengan cat tinting? Beberapa perbedaan positif dan negatif dari cat&nbsp;<em>ready stock</em>&nbsp;dengan teknologi tinting ini, yaitu :</p>\r\n\r\n<ol>\r\n	<li><strong>Cat Teknologi Tinting memiliki stok warna yang sangat banyak.</strong>&nbsp;Kalau cat warna&nbsp;<em>ready stock</em>&nbsp;hanya memiliki pilihan warna yang terbatas, cat dengan teknologi tinting ini memungkinkan anda memilih dalam ratusan, bahkan ribuan varian warna-warna yang unik!</li>\r\n	<li><strong>Cat Teknologi Tinting tidak akan pernah kehabisan stock.</strong>&nbsp;Kalau cat warna&nbsp;<em>ready stock</em>mempunyai stok yang terbatas dan ada kemungkinan sudah habis dipesan orang lain, cat teknologi tinting ini hanya memiliki sedikit kemungkinan habis dipesan orang lain. Memang suatu saat bisa saja tiba-tiba habis jika stok warna dasar yang kami sediakan ternyata tidak mencukupi permintaan. Dan kalaupun memang sedang tidak ada stok, kami bisa menyediakannya dalam waktu yang lebih cepat daripada stok warna&nbsp;<em>ready stock</em>.</li>\r\n	<li><strong>Memerlukan waktu lebih lama dalam memilih warna sampai membuat warnanya.</strong>&nbsp;Karena keunggulan-keunggulan tadi, tidak heran kalau anda harus menyiapkan waktu yang lebih banyak. Tentunya memilih warna dari ribuan pilihan warna yang tersedia itu tidak secepat yang kita duga. Dan proses pembuatannya pun cukup memakan waktu kira-kira 30 menit. Tapi hal ini bukan suatu masalah yang besar, kalau kita benar-benar menginginkan warna yang unik.</li>\r\n</ol>\r\n\r\n<p>Bagaimana, apakah anda tertarik untuk mencoba cat dengan teknologi tinting ini? Silakan mampir ke outlet kami, karena kami melayani pemesanan cat dengan warna&nbsp;<em>ready stock</em>, maupun warna tinting.</p>\r\n', 1, 'artss.JPG', 1, 3),
(6, '2015-12-29 13:44:52', 'Pengaruh Warna Tembok Terhadap Kualitas Tidur', 'pengaruh-warna-tembok-terhadap-kualitas-tidur', 'tembok, warna tembok, tidur', 'Pernahkah kita merasa susah sekali tidur sekalipun kita sudah merem dengan tenang diatas kasur? Tentunya rasanya sangat nggak enak, akibatnya kita jadi gelisah guling-guling kesana, guling-guling kesini, akhirnya tidur dengan waktu yang lebih singkat.', '<p>Pernahkah kita merasa susah sekali tidur sekalipun kita sudah merem dengan tenang diatas kasur? Tentunya rasanya sangat nggak enak, akibatnya kita jadi gelisah guling-guling kesana, guling-guling kesini, akhirnya tidur dengan waktu yang lebih singkat.</p>\r\n\r\n<p>Ternyata sebuah studi di Inggris mengaitkan hal ini dengan warna tembok ruangan kita. Sampel yang mereka teliti adalah 2000 rumah di suatu tempat di Inggris. Menurut mereka, ada beberapa warna yang bisa membantu seseorang untuk tidur, tapi ada juga warna yang membuat orang cenderung lebih sulit tidur.</p>\r\n\r\n<p>Seorang pakar khusus yang ahli di bidang tidur (lebih kerennya&nbsp;<em>Sleep Expert</em>&nbsp;), Chris Idzikowski dari Edinburgh Sleep Centre mengatakan kalau ini adalah sebuah penemuan yang menakjubkan. Karena dalam bagian retina mata, ada reseptor khusus yang bernama&nbsp;<em>ganglion cells</em>&nbsp;yang sangat sensitif terhadap warna. Dari hasil penelitian tersebut, didapatkan jam tidur rata-rata dari 2000 sampel tadi.</p>\r\n\r\n<p>3 warna yang sangat disarankan adalah warna Biru, dengan rata-rata jam tidur sekitar 7 jam 52 menit. Kuning dengan rata-rata jam tidur sekitar 7 jam 40 menit, Hijau dengan rata-rata jam tidur sekitar 7 jam 36 menit. Dan 3 warna yang tidak disarankan adalah warna Abu-abu, dengan rata-rata jam tidur sekitar 6 jam 12 menit, Coklat, dengan rata-rata jam tidur sekitar 6 jam 5 menit, dan Ungu, dengan rata-rata jam tidur sekitar 5 jam 56 menit.</p>\r\n\r\n<p>Warna yang tidak disebutkan secara umum tidak terlalu nyaman, dan tidak terlalu buruk juga. Bagaimana dengan warna tembok ruangan anda? Apakah termasuk ke 3 warna ternyaman, atau sebaliknya? Jika anda susah tidur dengan ruangan anda yang sekarang, apakah anda tertarik mengganti warna cat tembok ruangan seperti yang disarankan?</p>\r\n\r\n<p><em>Sumber :&nbsp;<a href="http://gayahidup.plasa.msn.com/" target="_blank">http://gayahidup.plasa.msn.com/</a><br />\r\nEditor : Christian Rosandhy</em></p>\r\n', 4, 'desain-kamar-kos.jpg', 1, 2),
(7, '2015-05-22 11:06:52', 'Penyelesaian Masalah : Warna Tembok Tidak Rata', 'penyelesaian-masalah-:-warna-tembok-tidak-rata', 'tembok, tembok tidak rata, cara agar tembok rata', 'Tentunya setiap kita ingin sekali dong punya tembok yang indah, Tembok dengan warna yang sesuai dengan selera kita, tembok dengan warna yang rapi dan bersih.. Tapi sayangnya, ada salah satu masalah pengecatan yang cukup mengganggu keindahan tembok, yaitu ', '<p>Tentunya setiap kita ingin sekali dong punya tembok yang indah, Tembok dengan warna yang sesuai dengan selera kita, tembok dengan warna yang rapi dan bersih.. Tapi sayangnya, ada salah satu masalah pengecatan yang cukup mengganggu keindahan tembok, yaitu warna yang tidak rata.</p>\r\n\r\n<p>Warna tembok tidak rata / belang biasanya terjadi karena 2 hal. Yang pertama, ketika kita melanjutkan tembok yang sudah dicat dengan nama warna yang sama, tapi merk yang berbeda. Misalnya, awalnya kita mengecat tembok kita dengan warna Adelweiss merk&nbsp;<a href="http://cwabali.com/view/Weldon_Wallpaint">Weldon</a>. Lalu, karena ternyata catnya sudah habis dan kita ingin beli lagi untuk melanjutkan pengecatan, kita membeli warna Adelweiss juga, tapi merk&nbsp;<a href="news://view/Envi">Envi</a>. Sekalipun nama warnanya sama, perlu diingat kalau hasil yang diberikan tiap merk akan berbeda-beda.</p>\r\n\r\n<p>Yang kedua, karena proses pengecatan yang tidak sesuai prosedur yang disarankan. Pengecatan disarankan dilakukan dalam 2 - 3x lapis (tergantung merk, rata-rata&nbsp;cukup dilakukan 2x). Tapi, ada juga yang sayang catnya cepat habis, jadi dibiarkan satu kali lapis saja biar hemat. Toh sudah cukup berwarna kok.. Sayangnya, setelah cat mengering nanti, warna yang melekat ditembok akan menjadi sedikit lebih pudar, dan akan sangat terlihat jelas bagian yang tebal dan tipis.. Padahal, kalau kita mengecat dalam 2x lapis, perbedaan ketebalan warna ketika cat mengering tidak akan terlalu terlihat, karena sudah cukup tebal.</p>\r\n\r\n<p>Lantas, bagaimana jika cat di tembok saya sudah seperti ini? Jika cat yang tidak rata itu masih bagus dan tidak terkelupas, anda bisa langsung menumpuknya dengan cat tembok warna yang sama / warna yang lain. Kalau anda memilih menumpuk dengan warna lain, disarankan menggunakan cat&nbsp;<a href="http://cwabali.com/view/Weldon_Wallpaint">Weldon</a>&nbsp;yang memiliki daya tutup yang lebih baik. Tentunya jangan lupa juga, tetap menggunakan prosedur 2x lapisan setelah lapisan pertama mengering.</p>\r\n\r\n<p>Lalu, jika ternyata cat tembok lama anda yang warnanya tidak rata juga sudah rusak dan terkelupas, disarankan segera mengerok seluruh lapisan tembok lama dengan scraper. Tidak ada batasan dalam memilih alat cat, Anda bisa menggunakan kuas, kuas roller, atau spray sekalipun. Semoga artikel ini membantu kita mengenal, memahami dan menyelesaikan masalah tembok kita jika memiliki warna yang tidak rata.</p>\r\n', 2, 'tembok.jpg', 1, 107),
(8, '2015-12-29 11:09:35', 'Makna Dibalik Warna', 'makna-dibalik-warna', 'warna, makna warna, arti warna', 'Tahukah anda, kalau dibalik setiap warna yang kita pilih itu menunjukkan karakter kita juga? Mungkin kita memang hanya sembarangan memilih warna, tapi secara tidak sadar warna tersebut mewakili karakter kita. Berikut adalah beberapa warna beserta dengan k', '<p>Tahukah anda, kalau dibalik setiap warna yang kita pilih itu menunjukkan karakter kita juga? Mungkin kita memang hanya sembarangan memilih warna, tapi secara tidak sadar warna tersebut mewakili karakter kita. Berikut adalah beberapa warna beserta dengan karakternya.</p>\r\n\r\n<ol>\r\n	<li><strong>Merah</strong>&nbsp;Warna Merah memiliki makna berani (seperti bendera Indonesia, bukan?). Biarpun bermakna berani, tapi warna merah juga bermakna berjiwa muda&nbsp;<em>(youthful)</em>. Dan diatas itu semua, warna merah juga bermakna kegembiraan yang begitu besar. Warna ini sangat cocok untuk anak-anak muda.</li>\r\n	<li><strong>Oranye</strong>&nbsp;Oranye ini adalah warna diantara kuning dan merah. Warna ini menjelaskan tentang kepercayaan diri yang baik. Juga memberikan kesan yang riang, bahagia, dan ramah. Karena itu, tidak jarang ruangan anak diberi sentuhan warna oranye supaya anak-anak menjadi lebih riang dan ramah.</li>\r\n	<li><strong>Kuning</strong>&nbsp;Kuning adalah warna memberikan kesan kehangatan. Tidak cuma itu saja, warna kuning juga menjelaskan tentang kejelasan yang sangat optimis. Artinya, warna kuning mengandung makna optimis yang penuh kehangatan. Warna ini sangat cocok untuk perusahaan yang menjalin kehangatan dengan pelanggan.</li>\r\n	<li><strong>Hijau</strong>&nbsp;Warna hijau, cenderung mengarah ke warna tumbuhan. Sehingga ada karakter pertumbuhan dibalik warna hijau ini. Warna hijau selalu dikatakan menyehatkan mata. Karena itu, ada juga karakter kesehatan dibalik warna hijau. Dan, yang paling hebatnya, warna hijau juga terlihat lebih damai. Warna ini sangat cocok untuk ruangan anak-anak kecil, atau ruangan keluarga.</li>\r\n	<li><strong>Biru</strong>&nbsp;Survey menunjukkan, bahwa warna biru adalah warna yang paling dipilih orang kebanyakan. Entah itu biru laut, biru langit, warna biru ini memiliki makna teguh, tenang, dan benar-benar mengharapkan kepercayaan penuh. Tidak heran, warna ini banyak dipilih, karena karakteristiknya ini.</li>\r\n	<li><strong>Ungu</strong>&nbsp;Warna ungu ini cukup jarang dipilih orang kebanyakan. Wajar saja, karena makna yang dikandungnya juga sangat hebat, yaitu kreatif dan imajinatif. Orang yang memilih warna ungu memang cenderung bijak dan memiliki kreatifitas yang tinggi. Karena itu, warna ini sangat cocok untuk orang-orang kreatif.</li>\r\n	<li><strong>Putih / Abu-abu</strong>&nbsp;Warna putih atau abu-abu digolongkan menjadi satu, karena memiliki karakteristik yang mirip. yaitu benar-benar warna yang tenang, bersifat netral, dan sangat seimbang untuk dipadukan dengan warna yang lain. Karena sifatnya yang netral ini, warna putih dan abu-abu bisa digabungkan dengan warna yang lain, sehingga selalu mengikuti karakteristik warna yang lain.</li>\r\n</ol>\r\n\r\n<p>Itulah makna-makna dibalik setiap warna. Warna apapun yang kita pilih, ternyata memiliki makna positif yang sesuai dengan karakter kita. Semoga artikel ini membuka wawasan kita tentang warna yang begitu luas.</p>\r\n', 1, 'warna.jpg', 1, 6),
(9, '2015-12-29 11:11:48', 'Menghilangkan Noda Krayon pada Tembok', 'menghilangkan-noda-krayon-pada-tembok', 'menghilangkan noda pada tembok, hapus krayon tembok', 'Bukan suatu hal yang aneh lagi kalau anak-anak yang aktif suatu saat akan mencoret-coret tembok, bukan? Tentunya itu memang hal yang cukup wajar dilakukan anak-anak. Lantas, bagaimana kita mengembalikan keindahan warna tembok kita seperti semula? Berikut ', '<p>Bukan suatu hal yang aneh lagi kalau anak-anak yang aktif suatu saat akan mencoret-coret tembok, bukan? Tentunya itu memang hal yang cukup wajar dilakukan anak-anak. Lantas, bagaimana kita mengembalikan keindahan warna tembok kita seperti semula? Berikut adalah beberapa cara membersihkan tembok dari noda krayon:</p>\r\n\r\n<ol>\r\n	<li>Memudarkan noda tembok dengan&nbsp;<strong>Tisu Basah</strong>. Ini adalah cara paling sederhana, dan hanya bersifat memudarkan saja. Tisu basah diusapkan pada noda tembok hingga pudar secara perlahan.</li>\r\n	<li>Membersihkan tembok menggunakan&nbsp;<strong>Baking Soda</strong>. Caranya yaitu dengan menaburkan sedikit baking soda pada spons basah. Gosok dengan gerakan memutar pada noda krayon di tembok sampai noda memudar. Jika sudah cukup pudar, basahi spons dengan sabun cuci piring, lalu gosokkan lagi pada tembok sampai bersih.</li>\r\n	<li>Menggunakan&nbsp;<strong>Pasta Gigi / Odol</strong>. Caranya, oleskan pasta gigi pada kain lap basah. Gunakan kain ini untuk membersihkan noda tembok dengan mengusapnya dengan cepat. Ulangi langkah ini sampai noda benar-benar hilang, kemudian terakhir bila sudah bersih jangan lupa dibilas.</li>\r\n</ol>\r\n\r\n<p>Ketiga cara tersebut bisa anda coba sesuai kebutuhan Anda. Semoga artikel ini membantu kita membersihkan tembok yang terkena noda krayon.</p>\r\n', 2, 'tips_menghilangkan_noda_krayon_di_tembok_(2).jpg', 1, 0),
(10, '2015-12-29 11:14:21', 'Penyelesaian Masalah : Cat Tembok Bergelembung', 'penyelesaian-masalah-:-cat-tembok-bergelembung', 'cat tembok bergelembung, cara agar tidak bergelembung', 'Bukan hal yang jarang lagi, kita menemukan tembok di suatu tempat yang catnya menggelembung. Dan apakah kalau orang melihatnya lalu diam saja? Nggak juga.. Pasti akan ada saja yang tangannya gatal untuk mengorek-ngorek tembok yg bergelembung tadi sampai m', '<p>Bukan hal yang jarang lagi, kita menemukan tembok di suatu tempat yang catnya menggelembung. Dan apakah kalau orang melihatnya lalu diam saja? Nggak juga.. Pasti akan ada saja yang tangannya gatal untuk mengorek-ngorek tembok yg bergelembung tadi sampai mengelupas. Tentunya kalau sudah mengelupas, temboknya menjadi tidak terlalu enak dilihat.<br />\r\n<br />\r\nKalau ditelusuri cat tembok yang menggelembung itupun ada sebabnya. Tidak lain karena tembok itu dicat pada saat masih sangat lembab. Sehingga, cat tembok tidak bisa menempel dengan sempurna pada dinding, dan terlihat sebagai bentuk gelembung yang mudah terkelupas.<br />\r\n<br />\r\nPadahal hal ini bisa dicegah dengan memilih waktu pengecatan yang tepat, yaitu saat siang hari yang masih panas, dan juga dengan memilih cat tembok dengan kualitas yang baik seperti&nbsp;<a href="http://cwabali.com/view/Weldon_Wallpaint" target="_blank">Weldon Wallpaint</a>,&nbsp;<a href="http://cwabali.com/view/Envi" target="_blank">Cat Tembok Envi</a>, atau cat tembok sekaligus anti alkali dan anti air&nbsp;<a href="http://cwabali.com/view/Top_Seal">Top Seal</a>.<br />\r\n<br />\r\nKalau tembok anda sudah terlanjur seperti ini, ada juga cara memperbaikinya :</p>\r\n\r\n<ul>\r\n	<li>Amplas tembok pada bagian yang bergelembung, atau yang sudah terkelupas hingga bersih dan rata.</li>\r\n	<li>Lapisi bagian tembok dengan dempul sedikit saja. Tidak usah terlalu tebal, karena kita tidak sedang mengecat ulang seluruh bagian tembok.</li>\r\n	<li>Setelah dempul kering, jangan lupa gunakan pelapis&nbsp;<a href="http://cwabali.com/produk/WTRPF">waterproofing (anti air)</a>&nbsp;untuk mencegah kerusakan lebih parah kedepannya.</li>\r\n	<li>Yang terakhir, lapisi kembali bagian tembok yang sudah diberi dempul dan anti air tadi itu dengan cat tembok yang warnanya sama dengan cat yang sebelumnya. Gunakan cat tembok dengan merk dan kode warna yang sama persis dengan yang sebelumnya untuk mencegah&nbsp;<a href="http://cwabali.com/artikelView/Penyelesaian_Masalah_:_Warna_Tembok_Tidak_Rata" target="_blank">warna tembok yang tidak rata</a>.</li>\r\n</ul>\r\n\r\n<p><br />\r\nItulah teknik-teknik mengatasi tembok yang bergelembung dan mengelupas. semoga bermanfaat untuk tembok rumah kita.</p>\r\n', 2, '1352251807-MELELEH_2.jpg', 1, 2),
(11, '2015-12-29 11:16:13', 'Perbandingan Kuas dengan Roll', 'perbandingan-kuas-dengan-roll', 'kuas, roll, kuas dan roll', 'Kegiatan pengecatan adalah hal yang sangat menyenangkan, karena memberi kesan tersendiri ketika kita menuangkan warna pada tembok kita. Dalam proses pengecatan sendiri, dikenal beberapa alat bantu pengecatan, seperti kuas, roll, dan spray. Akan tetapi, ku', '<p>Kegiatan pengecatan adalah hal yang sangat menyenangkan, karena memberi kesan tersendiri ketika kita menuangkan warna pada tembok kita. Dalam proses pengecatan sendiri, dikenal beberapa alat bantu pengecatan, seperti kuas, roll, dan spray. Akan tetapi, kuas spray umumnya digunakan untuk medium yang lebih kecil seperti besi, helm, atau meja. Sedangkan untuk tembok yang paling umum digunakan adalah kuas dan roll. Diantara kuas biasa dan roll, alat yang mana yang sebaiknya dipakai untuk memberi hasil yang lebih baik? Ternyata kuas biasa dan roll memiliki kelebihan dan kekurangannya masing-masing, seperti berikut ini:</p>\r\n\r\n<ol>\r\n	<li><strong>Dari Segi Penggunaan.</strong>&nbsp;Kuas biasa menggunakan cat dengan jumlah yang jauh lebih sedikit daripada roll. Dalam hal ini, menggunakan roll lebih boros 40% daripada menggunakan kuas biasa.</li>\r\n	<li><strong>Dari Segi Hasil Akhir.</strong>&nbsp;Kuas biasa memberikan hasil yang halus. Akan tetapi, bila dilihat dari dekat akan terlihat motif garis tipis yang terbentuk dari jejak kuas. Sedangkan roll juga memberikan hasil yang tidak jauh berbeda. Hanya saja, bila dilihat dari dekat akan terlihat seperti motif kulit jeruk.</li>\r\n	<li><strong>Dari Segi Waktu Pengecatan.</strong>&nbsp;Mengecat menggunakan kuas biasa sudah jelas jauh lebih lama, karena ketika kuas dicelupkan ke dalam cat, kuas tersebut tidak mampu menyimpan warna yang cukup banyak. Berbeda dengan roll yang mampu menyimpan warna yang cukup banyak, sehingga lebih cepat selesai.</li>\r\n	<li><strong>Dari Segi Jangkauan.&nbsp;</strong>Kuas biasa sangat mungkin menjangkau sudut-sudut ruangan, karena ukurannya yang kecil. Berbeda dengan roll yang sangat tidak mungkin menjangkau sudut-sudut ruangan.</li>\r\n	<li><strong>Dari Segi Cipratan yang Dihasilkan.</strong>&nbsp;Kuas biasa tidak terlalu memberikan banyak cipratan, tidak seperti roll yang memberi cukup banyak cipratan.</li>\r\n</ol>\r\n\r\n<p>Setelah melihat perbandingan ini, kita bisa melihat kalau kuas masih lebih unggul dalam hal banyaknya penggunaan, jangkauan, dan sedikitnya cipratan. Akan tetapi, kuas memiliki kelemahan fatal yaitu waktu pengecatan yang jauh lebih lama. Karena itu, akan jauh lebih baik bila kita menggunakan kedua alat ini dalam satu proyek. Roll digunakan untuk mengecat bagian yang luas supaya menghemat waktu, dan kuas digunakan untuk mengisi bagian-bagian kosong di sudut-sudut ruangan. Supaya hasilnya lebih indah, pastikan arah pengecatan kuas dan roll tetap sama, supaya tidak ada bagian yang tidak rata karena penggunaan 2 alat yang berbeda ini. Semoga artikel ini berguna untuk menambah wawasan kita tentang kuas dan roll.</p>\r\n', 1, 'article_kuas_roll.jpg', 1, 2),
(12, '2015-12-29 11:19:45', 'Membagi Ruangan tanpa Dinding', 'membagi-ruangan-tanpa-dinding', 'ruangan, ruangan tanpa dindin, cara membagi ruangan tanpa dinding', 'Sebagian orang merasa, mengatur interior rumah dengan konsep open spacemerupakan solusi yang tepat. Jadi, biarpun luas rumah tidak begitu besar, tapi interiornya tetap terasa lega dan segar. Tantangannya adalah bagaimana kita bisa membuat perbedaan antar ', '<p>Sebagian orang merasa, mengatur interior rumah dengan konsep&nbsp;<em>open space</em>merupakan solusi yang tepat. Jadi, biarpun luas rumah tidak begitu besar, tapi interiornya tetap terasa lega dan segar. Tantangannya adalah bagaimana kita bisa membuat perbedaan antar ruangan tanpa perlu sekat sebagai pemisahnya? Kontributor&nbsp;<a href="http://houzz.com/" target="_blank">Houzz.com</a>&nbsp;<em>Jen Dalley</em>&nbsp;punya jawabannya.</p>\r\n\r\n<p>Dalley menyarankan Anda mengubah ketinggian lantai untuk membedakan dengan area yang lain. Biarpun tidak ada dinding, perbedaan ketinggian lantai bisa membuat area tersebut terasa istimewa. Tidak cuma meninggikan satu area. Anda juga bisa menenggelamkan area tersebut dengan membuatnya lebih rendah dari area lain. Cara ini membuat area tersebut terasa lebih intim dan menenangkan. Cara kedua merupakan kebalikannya. bukan meninggikan atau menenggelamkan bagian lantai, tapi memberikan desain yang berbeda pada plafon.</p>\r\n\r\n<p>Ada beberapa cara untuk memberikan aksen berbeda pada plafon. Dalley mencontohkan penggunaan aksen kayu. Tidak hanya bagian plafon, dinding yang menempel pada area plafon ditutup dengan papan kayu. Menempatkan aksen ini dalam ruangan yang dipenuhi warna putih, memberikan kesan hangat tersendiri, sekaligus mengkhususkan area tersebut dan memisahkannya dari area lain. Jika menambah atau mengubah material baru pada ruangan tersebut cukup sulit, Anda bisa menggunakan cat sebagai penggantinya. Pilihlah warna yang dramatis dan pertahankan konsistensi warna tersebut dari dinding ke plafon.</p>\r\n\r\n<p>Pastikan anda memilih cat yang berkualitas untuk hasil yang maksimal. Dalley juga mencontohkan cara lain untuk membagi ruangan dengan memanfaatkan benda atau obyek yang tidak menutup satu area dengan sempurna. Cara ini membuat Anda masih bisa melihat area di balik obyek tersebut, namun ada rasa terpisah dari area tersebut. Misalnya dengan penggunaan rak buku sebagai pemisah. Sekalipun rak buku tidak memisahkan ruangan dengan penuh, tapi hal ini menjadi kesan unik tersendiri.</p>\r\n\r\n<p>Dan cara terakhir, Dalley mengusulkan untuk membagi area dengan menggunakan material penutup lantai berbeda. Misalnya parket untuk dapur dan marmer untuk ruang makan, Dengan material yang berbeda pun kesan keterpisahan masih tetap terasa.</p>\r\n\r\n<p><em>Sumber :&nbsp;<a href="http://www.houzz.com/" target="_blank">www.houzz.com</a><br />\r\nEditor : Christian Rosandhy</em></p>\r\n', 2, 'lalala.jpg', 1, 6),
(13, '2015-12-29 13:41:29', 'Mengutak atik Tampilan Plafon', 'mengutak-atik-tampilan-plafon', 'plafon, customize plafon', 'Plafon sudah termasuk salah satu fitur di dalam rumah yang bisa kita utak-atik supaya tampil menarik. Biasanya, plafon hanya berwarna putih polos, karena biasanya desain hanya diatur di sekitar tembok dan interior. Akan tetapi, bukannya tidak mungkin kita', '<p>Plafon sudah termasuk salah satu fitur di dalam rumah yang bisa kita utak-atik supaya tampil menarik. Biasanya, plafon hanya berwarna putih polos, karena biasanya desain hanya diatur di sekitar tembok dan interior. Akan tetapi, bukannya tidak mungkin kita bisa mengubah tampilan plafon menjadi lebih menarik.</p>\r\n\r\n<p>Kita bisa tetap menggunakan warna putih, tapi membuatnya tampak &quot;turun&quot; dengan permainan cahaya. Kita juga bisa memilih warna lain, bahkan tekstur lain dengan memanfaatkan kayu atau gipsum. &quot;Sering sekali kita melupakan plafon,&quot; ujar desainer Deborah Wecselman kepada Elle Decor. &quot;Anda bisa membuat pernyataan desain mencolok dengan menggunakan wallpaper atau cat tembok di plafon.</p>\r\n\r\n<p>Namun, jika Anda melakukan hal ini, pastikan Anda membuat dinding tetap sederhana,&quot;, katanya. Kita memang sangat bisa berkreasi dengan plafon. Tapi, jika plafon sudah tampak ramai dengan desain, jangan menambahkan banyak aksen pada dinding Anda. Biarkan dinding dilapisi dengan warna polos, tanpa corak atau banyak ornamen. Carilah warna dinding yang mampu melengkapi warna plafon Anda. Atau,sebagai alternatif lainnya, kita bisa memberikan&nbsp;<a href="http://localhost/cwa2016/produk/CTTB" target="_blank">cat tembok</a>&nbsp;pada bagian plafon.</p>\r\n\r\n<p>Karena itu, memilih&nbsp;cat tembok&nbsp;yang benar adalah alternatif yang baik untuk memberikan kesan ruangan yang berbeda. Desainer Matthew Patrick Smyth, seperti dikutip dalam Elle Decor, memilih menggunakan warna biru untuk plafon. &quot;Saya mungkin satu-satunya yang mengetahui hal ini, namun nuansa biru (pada cat tembok berwarna Blue Veil) membuat saya memikirkan langit,&quot; kata Smyth. Selain warna biru, kita juga bisa memberikan warna-warna cerah lainnya. Memberikan warna cerah akan membuat ruangan terkesan lebih luas, dan juga mampu memberi kesan membagi ruangan tanpa sekat.</p>\r\n\r\n<p><em>Sumber :&nbsp;<a href="http://www.freshome.com/" target="_blank">www.freshome.com</a><br />\r\nEditor : Christian Rosandhy</em></p>\r\n', 2, 'plafon.jpg', 1, 0),
(14, '2015-12-28 13:43:39', 'Jumlah Cat yang Dibutuhkan', 'jumlah-cat-yang-dibutuhkan', 'cat, jumlah cat, kisaran', 'Salah satu hal yang harus diketahui sebelum membeli cat adalah, kita harus tahu berapa banyak cat yang kita butuhkan, bukan? Sayangnya hal ini masih sulit diterapkan pada cat. Hal ini disebabkan karena kita hanya mengira-ngira saja kira-kira berapa banyak', '<p>Salah satu hal yang harus diketahui sebelum membeli cat adalah, kita harus tahu berapa banyak cat yang kita butuhkan, bukan? Sayangnya hal ini masih sulit diterapkan pada cat. Hal ini disebabkan karena kita hanya mengira-ngira saja kira-kira berapa banyak cat yang kita gunakan. Akibatnya, memang tidak terlalu fatal, hanya perlu menghabiskan waktu untuk membeli cat lagi sekali karena ternyata kekurangan, atau sebaliknya catnya terbuang karena banyak yang tidak terpakai. Bagaimana supaya kita tahu jumlah cat yang persis kita butuhkan?</p>\r\n\r\n<p>Ternyata setiap cat memiliki salah satu karakteristik yang dinamakan &quot;daya sebar&quot;. Daya sebar adalah satuan berapa luas cat yang diberikan cat tersebut setiap satuan liter/kilogramnya. Sayangnya setiap cat memiliki daya sebar yang berbeda-beda, tergantung merk dan kelas cat yang kita beli. Ada yang berdaya sebar 3-4m2/kg, ada yang sekitar 8m2, bahkan ada yang sampai 10m2. Karena itu, ada baiknya kita selalu menanyakan luas daya sebar dari setiap cat yang akan kita beli.</p>\r\n\r\n<p>Sebagai contoh, Cat Weldon memiliki daya sebar 8m2/kg. Berapa banyak cat yang kita perlukan untuk mengecat bagian rumah kita? Pertama-tama kita harus mengukur berapa luas bidang yang akan kita cat. Misalkan kita ingin mengecat pada tembok depan rumah dengan luas 5m x 2m. Maka luas permukaan bidang tersebut adalah 5m x 2m = 10m2 Tapi, jangan lupa juga untuk mengurangi hasil tersebut dengan luas pintu, jendela, atau luas apapun yang tidak akan kita cat pada bidang tersebut.</p>\r\n\r\n<p>Misalkan di tembok tadi ada sebuah pintu yang tentunya tidak akan dicat, dan mempunyai ukuran 2m x 1m. Maka, luas 10m2 tadi dikurangi lagi dengan luas pintu sebesar 2m2, menjadi 8m2.Dengan begitu, dengan luas 8m2 itu, kita hanya membutuhkan Cat Weldon dengan kemasan 1 kg saja. Ternyata dengan perhitungan yang tepat, kita lebih bisa menghemat uang sebisa mungkin dari sisa-sisa cat yang tidak terpakai. Semoga artikel ini berguna untuk setiap kita yang ingin membeli cat..</p>\r\n', 1, 'cat.jpg', 1, 0),
(15, '2015-12-28 13:45:12', 'Cara Mengecat Tembok', 'cara-mengecat-tembok', 'cat, cara ngecat tembok, cat tembok', 'Setelah kita mengetahui permasalahan-permasalahan yang dapat terjadi dalam proses pengecatan tembok, saat ini kita akan belajar bagaimana cara mengecat tembok dengan baik. Berikut adalah langkah-langkahnya:', '<p>Setelah kita mengetahui permasalahan-permasalahan yang dapat terjadi dalam proses pengecatan tembok, saat ini kita akan belajar bagaimana cara mengecat tembok dengan baik. Berikut adalah langkah-langkahnya:</p>\r\n\r\n<ul>\r\n	<li>Jika temboknya masih baru, lapiskan dahulu dengan primer / alkali sealer supaya cat tidak terserap ke pori-pori tembok yang masih banyak.</li>\r\n	<li>Sebaliknya, jika tembok yang ingin dicat adalah tembok lama, sebaiknya bersihkan dahulu tembok lama tersebut dari sisa-sisa cat lama dengan cara dikerok dengan scraper, setelah itu diamplas supaya lebih halus.</li>\r\n	<li>Perhatikan kelembaban tembok sebelum mulai mengecat. Pastikan kadar air dalam tembok tidak lebih dari 18%. Lebih disarankan pengecatan dilakukan pada siang hari dan cuaca cerah, supaya tembok tidak terlalu lembab.</li>\r\n	<li>Setelah itu anda sudah bisa memulai mengecat. Jumlah pengecatan dan jumlah campuran air tergantung merk yang anda pakai. Pastikan anda membacanya dengan teliti.</li>\r\n	<li>Setelah anda selesai mengecat, jangan lupa untuk membiarkan cat tersebut selama 1-3 jam supaya cat benar-benar kering.</li>\r\n</ul>\r\n', 4, '091205_womancat.jpg', 1, 0);
