(16, '2015-12-28 13:46:37', 'Macam macam Produk Citra Warna', 'macam-macam-produk-citra-warna', 'produk cwa, produk citra warna', 'Toko Cat CITRA WARNA menyediakan berbagai macam cat dan perlengkapan bangunan lainnya. Kali ini kita akan mengenal kegunaan dari macam-macam kategori barang yang kami sediakan.', '<p><strong>Toko Cat CITRA WARNA</strong>&nbsp;menyediakan berbagai macam cat dan perlengkapan bangunan lainnya. Kali ini kita akan mengenal kegunaan dari macam-macam kategori barang yang kami sediakan.</p>\r\n\r\n<ol>\r\n	<li><strong>Cat Tembok</strong>&nbsp;: Cat tembok juga digolongkan berdasarkan berbagai macam kelas. Mulai dari kelas Premium dengan harga yang lebih mahal, tapi kualitas yang sangat bagus, kelas Standar dengan harga yang tidak terlalu mahal, dan kualitas yang masih terjaga, juga kelas Ekonomis dengan harga yang sangat terjangkau. Selain itu, cat tembok juga digolongkan untuk 2 macam lokasi pengecatan, yaitu Eksterior untuk penggunaan di luar, dan Interior untuk penggunaan didalam ruangan. Cat eksterior memiliki daya tahan yang lebih bagus terhadap cuaca daripada cat interior.&nbsp;<strong><em>Cat Tembok Eksterior dengan kelas premium</em></strong>&nbsp;terdiri dari :<strong><a href="http://cwabali.com/produk/view/Paladin-Gold" target="_blank">Paladin Gold</a></strong>,&nbsp;<strong><a href="http://cwabali.com/produk/view/Belazo-Exterior-Finish" target="_blank">Belazo EF88</a></strong>,&nbsp;<a href="http://cwabali.com/produk/view/Dulux-Weathershield-Pro" target="_blank">Dulux Weathershield</a>,&nbsp;<a href="http://cwabali.com/produk/view/Mowilex-Weathercoat" target="_blank">Mowilex Weathercoat</a>, Jotashield (warna mixing), dan Kem-tone (warna mixing).&nbsp;<strong><em>Cat Tembok Interior dengan kelas premium</em></strong>terdiri dari :&nbsp;<strong><a href="http://cwabali.com/produk/view/Paladin-Silver" target="_blank">Paladin Silver</a></strong>,&nbsp;<strong><a href="http://cwabali.com/produk/view/Belazo-Multi-Emulsion" target="_blank">Belazo ME</a></strong>,&nbsp;<a href="http://cwabali.com/produk/view/Dulux-Pentalite" target="_blank">Dulux Pentalite</a>,&nbsp;<a href="http://cwabali.com/view/Mowilex-Emulsion" target="_blank">Mowilex Emulsion</a>, Danacryl (warna mixing), Jotun Majestic Royale matt, dan Pearl Silk(warna mixing),&nbsp;<strong><em>Cat Tembok Interior dengan kelas standar</em></strong>&nbsp;terdiri dari :&nbsp;<strong><a href="http://cwabali.com/produk/view/Envi" target="_blank">Envi</a></strong>,&nbsp;<strong><a href="http://cwabali.com/produk/view/Weldon-Wallpaint" target="_blank">Weldon Wallpaint</a></strong>,&nbsp;<a href="http://cwabali.com/produk/view/Dulux-Catylac" target="_blank">Catylac</a>,&nbsp;<a href="http://cwabali.com/produk/view/Vinilex" target="_blank">Vinilex</a>,&nbsp;<a href="http://cwabali.com/produk/view/paragon" target="_blank">Paragon</a>&nbsp;(hanya stok warna putih dan hitam), dan sebagainya.&nbsp;<strong><em>Cat Tembok interior dengan kelas Ekonomi</em></strong>terdiri dari :&nbsp;<strong><a href="http://cwabali.com/produk/view/Fresh_Lux" target="_blank">Fresh Lux</a></strong>, Maxilite, dan&nbsp;<a href="http://cwabali.com/produk/view/Mawar" target="_blank">Mawar</a>.</li>\r\n	<li><strong>Alkali Sealer</strong>&nbsp;: Disebut juga primer, atau undercoat. Biasanya digunakan pada dasar cat tembok, supaya cat bisa lebih melekat dengan baik.&nbsp;<a href="http://cwabali.com/produk/view/Weldon-Alkali-Sealer" target="_blank">Weldon Alkali Sealer</a>&nbsp;bisa membantu di kategori ini.</li>\r\n	<li><strong>Cat Kayu Besi</strong>&nbsp;: merupakan cat khusus kayu dan besi yang bersifat menutup media yang dicat. Cat ini memiliki daya sebar sekitar 3-4m2/ liter dengan 2x lapis. Thinner / pengencer yang digunakan adalah Thinner B, atau Afduner dengan campuran yang bisa dibaca di petunjuk yang diberikan pada produk. Terdiri dari :&nbsp;<a href="http://cwabali.com/produk/view/Envilux" target="_blank">Envilux</a>,&nbsp;<a href="http://cwabali.com/produk/view/Ocean-Gloss" target="_blank">Ocean Gloss</a>,&nbsp;<a href="http://cwabali.com/produk/view/Emco-Lux" target="_blank">Emco Lux</a>,&nbsp;<a href="http://cwabali.com/produk/view/Ftalit" target="_blank">Ftalit</a>, dan sebagainya.</li>\r\n	<li><strong>Politur / Finishing</strong>&nbsp;: merupakan pewarna kayu yang bersifat transparan, dan tidak menutup serat kayu, sehingga mempertahankan keaslian kayu, tetapi tetap memberi keindahan tersendiri. Produk yang disediakan antara lain: :<strong><a href="http://cwabali.com/produk/view/Belazo-Woodstain" target="_blank">Belazo Wood Stain</a></strong>, Mowilex Wood Stain,&nbsp;<a href="http://cwabali.com/produk/view/Aqua-Politur" target="_blank">Propan Aqua Politur</a>, dan sebagainya. Berbeda dengan cat kayu besi, thinner yang digunakan adalah Thinner A. Campuran thinner ini diantaranya adalah, Ultran Politur P-01, Ultran Politur P-03, Ultran Lasur, Teak Oil, dan lain-lain. Selain itu, ada juga jenis lain yang termasuk kategori politur, yaitu Melamine. Melamine adalah jenis finishing kayu yang berfungsi memperindah tampilan dengan tampilan yang lebih halus. Produk ini hanya disarankan untuk penggunaan interior. Diantaranya adalah, Impra Wood Filler, Impra Woodstain, Impra Sending Sealer, Impra Melamine.</li>\r\n	<li><strong>Roof Paint / Cat Genteng</strong>&nbsp;: adalah cat yang berfungsi memberi keindahan kepada genteng, dan selain itu juga mampu melindungi genteng dari lumut dan jamur. Produk yang kami tawarkan diantaranya,&nbsp;<strong><a href="http://cwabali.com/produk/view/Envi-Roof-Paint" target="_blank">Envi Roof Paint</a></strong>,&nbsp;<strong>Belazo Roof Paint</strong>,&nbsp;<a href="http://cwabali.com/produk/view/Ocean-Roof" target="_blank">Ocean Roof</a>,&nbsp;<a href="http://cwabali.com/produk/view/Sanlex" target="_blank">Sanlex</a>, Jotaroof (warna mixing), dan lain-lain.</li>\r\n	<li><strong>Waterproof</strong>&nbsp;: adalah cat anti rembes yang bisa digunakan untuk tembok luar, atap bangunan, ataupun eksterior. Waterproof memiliki ketahanan terhadap cuaca yang begitu baik. Produk yang kami tawarkan adalah,&nbsp;<strong><a href="http://cwabali.com/produk/view/WelProof" target="_blank">Welproof</a></strong>,&nbsp;<strong><a href="http://cwabali.com/produk/view/Top-Seal" target="_blank">Top Seal</a></strong>,&nbsp;<a href="http://cwabali.com/produk/view/Aquaproof" target="_blank">Aquaproof</a>,&nbsp;<a href="http://cwabali.com/produk/view/Ultraproof" target="_blank">Ultra Proof</a>,&nbsp;<a href="http://cwabali.com/produk/view/No-Drop" target="_blank">No Drop</a>, dan lain-lain.</li>\r\n	<li><strong>Vernis Batu / Coating Batu</strong>&nbsp;: Digunakan untuk memperindah tampilan batu, dan juga melindungi batu dari lumut dan jamur. Produk yang kami tawarkan adalah, Propan Stone Care, Propan Sicosol, Mowilex Varnish Batu Alam, Mowilex Clear Coating, AM Stone Coating, Arca, dan sebagainya.</li>\r\n	<li><strong>Cat Spray / Pylox</strong>&nbsp;: adalah cat yang sudah disediakan dalam bentuk semprotan. Produk yang kami tawarkan adalah,&nbsp;<strong><a href="http://cwabali.com/produk/view/Oxygen" target="_blank">Oxygen</a></strong>, dan&nbsp;<a href="http://cwabali.com/produk/view/Pylox" target="_blank">Pylox</a>.</li>\r\n	<li><strong>Cat Duco</strong>&nbsp;: adalah cat yang digunakan pada kendaraan ataupun kayu. Cat ini sangat halus, dan cepat kering. Karena itu memerlukan banyak thinner, tergantung kekentalan cat itu sendiri. Produk yang kami tawarkan adalah&nbsp;<a href="http://cwabali.com/produk/view/Nippe-2000" target="_blank">Nippe 2000</a>,&nbsp;<a href="http://cwabali.com/produk/view/Penta-Supergloss-NC-Solid" target="_blank">Penta Super Gloss</a>,&nbsp;<a href="http://cwabali.com/produk/view/Top-Color" target="_blank">Top Color</a>, dan lain-lain&nbsp;</li>\r\n</ol>\r\n', 4, 'cat_all.jpg', 1, 1),
(17, '2015-12-28 13:48:31', 'Permasalahan pada Pengecatan Tembok', 'permasalahan-pada-pengecatan-tembok', 'masalah pada cat, cat tembok bermasalah', 'Permasalahan pada Pengecatan Tembok. Chalking Lapisan film cat rusak karena pengaruh serangan dari garam alkali(biasa terjadi pada pengecatan tembok baru) atau pengaruh sinar matahari(pada tembok luar).pengenceran cat yang terlalu encer sehingga film cat ', '<p><strong>Chalking</strong>&nbsp;Lapisan film cat rusak karena pengaruh serangan dari garam alkali(biasa terjadi pada pengecatan tembok baru) atau pengaruh sinar matahari(pada tembok luar).pengenceran cat yang terlalu encer sehingga film cat tidak terbentuk sempurna Jika pengapuran hanya terdapat pada tempat tertentu,amplas bagian itu saja dan bersihkan dan beri lapisan cat kembali.jika terdapat pada seluruh tembok,rontokkan semua cat,bersihkan dan ulangi pengecatan(tunggu tembok kering dahulu).</p>\r\n\r\n<p><strong>Water Spot (Bercak Basah)</strong>&nbsp;Penyebabnya adalah penggunaan plamir yang belum kering sempurna dan diberi lapisan cat,sehingga air terjebak diantara dua hal tersebut dan mengakibatkan water spot Cara memperbaikinya adalah, amplas permukaan lapisan cat agar lebih porous dan air bisa keluar,jika jamur telah tumbuh pada bagian tersebut,cuci dengan kaporit kemudian cuci/lap dengan air bersih dan tunggu hingga benar-benar kering.</p>\r\n\r\n<p><strong>Blistering (Menggelembung)</strong>&nbsp;Cat mempunyai lapisan dan film yang rata,maka jika terdapat air didalamnya akan mengakibatkan menggelembungnya lapisan cat. Cara mengatasinya yaitu dengan dikerok.</p>\r\n\r\n<p><strong>Eflorescent (Pengkristalan)</strong>&nbsp;Terjadi pada permukaan plesteran tembok dimana garam muncul yang bersifat alkali muncul kepermukaan.jika Kristal-kristal itu muncul dibawah lapisan cat dan disertai kelembaban tembok akan merusak lapisan cat Untuk mencegahnya, pastikan bahwa tembok telah kering sempurna sehingga derajat alkali sudah memenuhi standar pengecatan (pH +8),dan garam alkali harus dibersihkan dahulu sampai tidak keluar lagi Bila sudah terlanjur kena, amplas permukaan lapisan cat agar lebih porous dan air bisa keluar, kemudian cuci/lap dengan air bersih dan tunggu hingga benar-benar kering,atau dengan dikerok lapisan cat yang sudah rusak</p>\r\n\r\n<p><strong>Saponification (Penyabunan)</strong>&nbsp;Serangan alkali pada lapisan cat yang berbahan perekat sejenis alkyd gloss. Alkali dan minyak akan bereaksi secara kimiawi yang disebut penyabunan dimana memberi hasil akhir seperti sabun dan menyebabkan lapisan cat menjadi lunak dan lengket. Bila sudah terkena, kerok lapisan cat lama, dan ganti dengan cat yang baru.</p>\r\n\r\n<p><strong>Discoloration (Perubahan Warna)</strong>&nbsp;Terjadi karena bahan perekat dan lapisan cat yang dirusak oleh garam atau bahan kimia yang berasal dari dalam atau udara,demikian pula pada pigmen warna cat juga dapat diserang. Jika sudah terjadi, lakukan pengecatan ulang dengan warna cat yang sesuai.</p>\r\n\r\n<p><strong>Crater (Permukaan Mata Ikan)</strong>&nbsp;Terjadi karena pengadukan cat yang belum sempurna. Karena itu, pastikan anda sudah mengaduk cat dengan baik sebelum digunakan. Jika sudah terjadi, tunggu sampai kering, kerok, dan lakukan pengecatan ulang.</p>\r\n\r\n<p><strong>Brushmarks (Garis bekas kuas)</strong>&nbsp;Penyebabnya adalah cat tidak mengalir rata saat dikuaskan,bisa karena teknik pengecatan yang tidak benar seperti pelapisan cat yang tidak teliti sehingga ketebalan tidak rata,pengenceran air yang kurang atau kuas saat dijalankan pada saat lapisan cat belum mengering. Kuas yang kotor atau bulu kuas yang menggumpal. Karena itu, pastikan cat sudah diencerkan dengan baik, dan gunakan kuas yang bermutu.</p>\r\n\r\n<p><strong>Flaking (Mengelupas)</strong>&nbsp;Terjadi karena pengecatan dilakukan pada bidang yang sudah mengapur,kotor dan berminyak sehingga daya rekat kurang. Bisa juga karena menggunakan plamir yang kurang bagus sehingga daya rekat tidak begitu kuat. Cara mengatasinya yaitu dengan mengerok lapisan cat lama yang bermutu rendah/permukaan yang sudah tidak bagus. Hindari pemakaian plamir/dempul terlalu tebal</p>\r\n\r\n<p>Itulah bermacam-macam permasalahan yang sering dihadapi orang ketika ingin mengecat. Semoga artikel ini membantu kita mengenali permasalahan tembok, dan menanganinya dengan tepat.</p>\r\n', 4, 'calking.png', 1, 0),
(18, '2015-12-22 13:50:06', 'Perhatikan Sebelum Mengecat', 'perhatikan-sebelum-mengecat', 'hal hal yang harus diperhatikan sebelum mengecat, masalah pada cat', 'Pertama kali, pentingnya untuk mengetahui apakah perlu atau tidaknya tembok disekrap, langkah yang harus dilakukan, kuaskan air pada permukaan dan tunggu sampai beberapa saat. Jika permukaan tampak gelembung-gelembung, maka tembok harus disekrap.', '<p>Pertama kali, pentingnya untuk mengetahui apakah perlu atau tidaknya tembok disekrap, langkah yang harus dilakukan, kuaskan air pada permukaan dan tunggu sampai beberapa saat. Jika permukaan tampak gelembung-gelembung, maka tembok harus disekrap.</p>\r\n\r\n<p>Bersihkan permukaan tembok yang akan di cat sebelumnya dengan menggunakan air hangat kemudian tunggu hingga kering sebelum anda melakukan proses pengecatan rumah. Untuk menghemat cat dan menutup pori-pori dinding disarankan menggunakan gunakan plamir. Setelah tembok atau bagian yang akan di cat telah kering, mulailah mengecat dengan plamir, tunggu sampai kering dan cat dengan dasar cat (putih) dan tunggu sampai kering.</p>\r\n\r\n<p>Untuk anda yang belum mempunyai teknik pengecatan, anda dapat mempraktekan teknik-teknik pengecatan di tahap ini. Karena baik atau jelek hasil anda, tidak akan kelihatan pada akhir pengecatan</p>\r\n', 0, 'blood-stain-splash_design.png', 1, 3),
(19, '2015-05-22 13:51:49', 'Perhatikan Sebelum Mengecat', 'perhatikan-sebelum-mengecat', 'hal hal yang harus diperhatikan sebelum mengecat, masalah pada cat', 'Pertama kali, pentingnya untuk mengetahui apakah perlu atau tidaknya tembok disekrap, langkah yang harus dilakukan, kuaskan air pada permukaan dan tunggu sampai beberapa saat. Jika permukaan tampak gelembung-gelembung, maka tembok harus disekrap.', '<p>Pertama kali, pentingnya untuk mengetahui apakah perlu atau tidaknya tembok disekrap, langkah yang harus dilakukan, kuaskan air pada permukaan dan tunggu sampai beberapa saat. Jika permukaan tampak gelembung-gelembung, maka tembok harus disekrap.</p>\r\n\r\n<p>Bersihkan permukaan tembok yang akan di cat sebelumnya dengan menggunakan air hangat kemudian tunggu hingga kering sebelum anda melakukan proses pengecatan rumah. Untuk menghemat cat dan menutup pori-pori dinding disarankan menggunakan gunakan plamir. Setelah tembok atau bagian yang akan di cat telah kering, mulailah mengecat dengan plamir, tunggu sampai kering dan cat dengan dasar cat (putih) dan tunggu sampai kering.</p>\r\n\r\n<p>Untuk anda yang belum mempunyai teknik pengecatan, anda dapat mempraktekan teknik-teknik pengecatan di tahap ini. Karena baik atau jelek hasil anda, tidak akan kelihatan pada akhir pengecatan</p>\r\n', 4, 'blood-stain-splash_design.png', 1, 3),
(20, '2015-12-22 13:53:37', 'Mengecat Kendaraan Mobil Motor dengan Baik', 'mengecat-kendaraan-mobil-motor-dengan-baik', 'cara cat kendaraan, cara cat motor, cat mobil, cara cat mobil', 'Nggak cuma tembok saja yang perlu kita cat secara berkala, kendaraan juga perlu kita cat supaya kita nggak cepat bosan. Akan tetapi, apakah cara dan bahan untuk mengecat kendaraan itu sama seperti mengecat tembok? Ternyata langkah-langkahnya agak mirip, t', '<p>Nggak cuma tembok saja yang perlu kita cat secara berkala, kendaraan juga perlu kita cat supaya kita nggak cepat bosan. Akan tetapi, apakah cara dan bahan untuk mengecat kendaraan itu sama seperti mengecat tembok? Ternyata langkah-langkahnya agak mirip, tetapi bahan yang diperlukan berbeda. Karena itu, mari kita pelajari caranya..</p>\r\n\r\n<ol>\r\n	<li>Pertama-tama, amplas dulu bagian kendaraan yang ingin dicat. Disarankan menggunakan amplas no 800 yang waterproof. Setelah itu, gunakan amplas no 1000 untuk lebih menghaluskannya.</li>\r\n	<li>Cuci kendaraan yang sudah diamplas tadi dengan air bersih. Keringkan dengan kain, dan jemur sampai benar-benar kering. Dengan kata lain, lebih baik pengecatan ini dilakukan ketika cuaca sedang benar-benar terik supaya lebih optimal.</li>\r\n	<li>Setelah kering, cat permukaan kendaraan yang ingin di cat dengan epoxy. Lagi-lagi setelah diberi epoxy kita harus jemur dahulu. Setelah kering, kita haluskan lagi dengan amplas yang paling halus, no 1200. Pengamplasan kali ini hanya bertujuan menghaluskan permukaan sebelum di cat. Setelah itu, cuci lagi dengan air bersih, dan jemur lagi hingga kering.</li>\r\n	<li>Sekarang masuk ke bagian pengecatan. Gunakan cat dasar yang diinginkan. Anda bisa menggunakan cat berwarna putih, ataupun cat yang berwarna hitam. Hindari debu ketika mengecat, supaya hasil lebih rata. Amplas lagi sekali dengan amplas no 1200. Pengamplasan kali ini cukup tipis-tipis saja, supaya cat dasarnya tidak menipis.</li>\r\n	<li>Setelah diberi cat dasar, sekarang masuk ke proses pemberian warna. Pilih cat duco dengan warna yang Anda suka. Campuran cat bisa diencerkan dengan Thinner. Perbandingan cat dengan thinnernya tergantung merk yang Anda beli. Karena itu perhatikan juga petunjuk kerja di kaleng cat baik-baik. Setelah dicat, jemur lagi hingga benar-benar kering.</li>\r\n	<li>Proses pengecatan selesai sampai disini, tapi setelah cat benar-benar kering, kita juga bisa memberinya pernis tambahan, supaya kendaraan kita terlihat mengkilap.</li>\r\n</ol>\r\n\r\n<p>Itulah langkah-langkah untuk mengecat kendaraan dengan cat duco. Anda bisa mencarinya di semua cabang outlet Citra Warna&nbsp;Semoga bermanfaat untuk kita semua..</p>\r\n', 5, '1431_p1_s_1.jpg', 1, 0),
(21, '2014-07-17 13:55:48', 'Mengenal Politur Finishing Kayu', 'mengenal-politur-finishing-kayu', 'cat politur, cat kayu, cat politur kayu', 'Politur / Finishing bukan suatu item baru dalam dunia pengecatan. Akan tetapi, politur ini adalah salah satu barang yang cukup membingungkan orang-orang. Karena itu, hari ini kita akan sedikit mengenal tentang politur dan kegunaannya. ', '<p>Politur / Finishing bukan suatu item baru dalam dunia pengecatan. Akan tetapi, politur ini adalah salah satu barang yang cukup membingungkan orang-orang. Karena itu, hari ini kita akan sedikit mengenal tentang politur dan kegunaannya. Politur adalah pewarna kayu yang bersifat transparan, dan tidak menutup serat kayu, sehingga kayu nampak lebih indah. Daya sebarnya &plusmn; 3- 4m2&nbsp;/liter, dengan 2 kali lapis, dan campuran air 10%. Contoh produknya adalah,&nbsp;Belazo Wood Stain, Mowilex Wood Stain,&nbsp;Propan Aqua Politur, dan sebagainya. Politur ini juga memerlukan pengencer, dengan nama Thinner. Thinner yang digunakan adalah Thinner A, dengan daya sebar &plusmn; 3- 4m2&nbsp;hanya dengan campuran thinner sekitar 5%. Produk Thinner untuk kategori ini adalah Ultran Politur, Ultran Lasur, dan Teak Oil. Ada juga jenis politur yang lain, tapi lebih disarankan untuk penggunaan interior (kalau produk tadi akan memberikan hasil lebih bagus, sehingga cocok untuk eksterior). Produk ini disebut Melamine. Melamine adalah jenis politur yang memberikan hasil lebih halus. Pengerjaan menggunakan melamine ini memiliki lebih banyak tahap dan juga komponen lainnya, seperti, Impra Wood Filler,&nbsp;Impra Wood Stain, Impra Sending Sealer, Impra Melamine / Top Coat. Untuk info tipe thinner, jumlah campuran thinner, akan lebih baik jika dibaca di petunjuk kemasannya masing-masing, karena tiap merk memiliki karakteristik yang cukup berbeda, Semoga artikel ini membantu kita untuk lebih mengerti dan dapat memilih produk Finishing kayu yang sesuai dengan kebutuhan kita.</p>\r\n', 4, 'kayu.jpg', 1, 0),
(23, '2013-07-08 13:57:50', 'Cat Tembok Tahan Lama', 'cat-tembok-tahan-lama', 'cara agar cat tembok tahan lama', 'Pastinya mau dong kalau kita punya rumah dengan kualitas cat tembok yang tahan lama.. Tapi untuk hal itu, memang nggak bisa dilakukan sembarangan, dan harus ada sedikit usaha. Berikut tips-tipsnya supaya pengecatan kita bisa lebih tahan lama.', '<p>Pastinya mau dong kalau kita punya rumah dengan kualitas cat tembok yang tahan lama.. Tapi untuk hal itu, memang nggak bisa dilakukan sembarangan, dan harus ada sedikit usaha. Berikut tips-tipsnya supaya pengecatan kita bisa lebih tahan lama.</p>\r\n\r\n<ul>\r\n	<li><strong>Perhatikan Tipe Cat yang Anda Beli</strong>. Seperti yang sudah kita tahu, cat tembok dibagi menjadi 2 tipe, yaitu Cat tembok Eksterior, dan Cat tembok Interior. Bukan masalah besar kalau kita hanya ingin mengecat dalam ruangan, tapi jangan sampai kita beli cat interior (karena tentunya lebih murah) untuk pemakaian di luar ruangan. Cat Interior sama sekali tidak didesain untuk tahan lama terhadap paparan sinar matahari dan perubahan cuaca. Sangat disarankan, penggunaan cat untuk luar ruangan menggunakan cat tembok khusus Eksterior (Belazo EF, Dulux Weathershield, Mowilex Weathercoat, Danashield, dsb). Bahkan, cat yang katanya bisa digunakan Eksterior dan Interior sekaligus pun tidak disarankan. Karena cat tipe eksterior interior sekaligus itu hanya sedikit lebih kuat dari cat tembok interior.</li>\r\n	<li><strong>Pilih Waktu Mengecat yang Tepat</strong>&nbsp;Sangat disarankan, pengecatan dilakukan saat siang hari, dan ketika cuaca sedang benar-benar cerah. Karena, tingkat kelembaban sangat mempengaruhi kualitas tembok yang akan kita cat. Karena, jika tembok terlalu lembab, cat yang menempel pun akan lebih cepat mengelupas dari biasanya.</li>\r\n	<li><strong>Pilih Warna yang Bersifat Cerah</strong>. Tahan lama hanya masalah waktu. Suatu saat, cat yang bermerk sangat bagus sekalipun pasti warnanya akan semakin pudar. Hanya saja, kalau cat biasa pudar dalam 2 tahun, cat berkualitas bisa lebih lama sampai 4-5 tahun untuk pudar. Tapi, hal itu tidak terlalu menjadi masalah jika kita memilih cat dengan warna yang cerah. Warna cerah memiliki pigmen warna yang lebih sedikit daripada yang berwarna pekat, sehingga tingkat kepudarannya lebih sedikit dibandingkan warna yang pekat.</li>\r\n</ul>\r\n', 2, 'cat_q76eqw.jpg', 1, 0),
(24, '2013-07-01 14:01:02', 'Pemilihan Warna Ruangan', 'pemilihan-warna-ruangan', 'Pemilihan Warna Ruangan, warna ruangan', 'Ketika anda memiliki skema ruangan, anda harus menentukan titik awal ruangan tersebut sebagai pedoman warna agar pemilihan warna menjadi lebih mudah. titik awal ini bisa berasal dari tembok, lantai, pajangan, lukisan favorit, benda seni atau ruangan.', '<p>Ketika anda memiliki skema ruangan, anda harus menentukan titik awal ruangan tersebut sebagai pedoman warna agar pemilihan warna menjadi lebih mudah. titik awal ini bisa berasal dari tembok, lantai, pajangan, lukisan favorit, benda seni atau ruangan.</p>\r\n\r\n<ul>\r\n	<li>Pemilihan warna akan memberi kesan berbeda terhadap luas ruangan anda</li>\r\n	<li>Warna gelap pada tembok akan membuat kesan ruangan menjadi lebih kecil, sedangkan warna terang pada tembok akan membuat kesan ruangan terlihat lebih luas</li>\r\n	<li>Warna gelap pada langit / plafond akan membuat ruangan menjadi lebih rendah sedangkan warna putih pada langit / plafond akan membuat ruangan menjadi lebih tinggi dan berudara</li>\r\n	<li>Warna cerah langit / plafond dipadu dengan warna gelap pada tembok akan membuat ruangan lebih tinggi dan sempit sedangkan warna cerah langit / plafond dipadu dengan warna cerah pada tembok akan membuat ruangan lebih rendah tetapi lebar</li>\r\n	<li>Warna terang pada sisi tembok dipadu dengan warna gelap diujung ruangan membuat lorong terkesan pendek, sedangkan warna gelap pada sisi tembok dipadu warna terang diujung ruangan membuat lorong terkesan lebih panjang</li>\r\n	<li>perpaduan warna kontras akan membuat ruangan lebih kecil, sedangkan warna senada akan membuat ruangan terkesan luas</li>\r\n</ul>\r\n\r\n<p>Tentunya setiap kita memiliki kreatifitas yang berbeda dalam menikmati ruangan. Semoga tips sederhana ini membantu anda bisa memiliki rumah yang indah dan nyaman.</p>\r\n', 2, '3292735-992413-roller-brush-with-red-paint.jpg', 1, 0),
(25, '2018-05-23 09:02:03', 'Telah Dibuka Toko Cat Citra Warna Tibubeneng', 'telah-dibuka-toko-cat-citra-warna-tibubeneng', 'cw16, cw Tibubeneng ', 'Hallo sahabat cwa, toko kami yang ke 16 beralamat di daerah Tibubeneng canggu sudah resmi dibuka ya, kalian bisa mengunjungi dan berbelanja cat di toko tersebut, oh iya selain itu ada promo juga lohh di citra warna Tibubeneng berikut ', '<p>Hallo sahabat&nbsp;cwa, toko kami yang ke&nbsp;16 beralamat di daerah Tibubeneng&nbsp;canggu sudah resmi dibuka ya, kalian bisa mengunjungi dan berbelanja cat di toko tersebut, oh iya selain itu ada promo juga lohh di citra warna Tibubeneng&nbsp;berikut detail promo nya :</p>\r\n\r\n<p>- Setiap pembelian cat dalam kemasan KG/Liter, Galon dan Pail dalam 1 nota (berlaku untuk semua produk cat), pelanggan berhak mendapatkan 1 buah hadiah yang telah disiapkan sesuai kategori (tidak berlaku kelipatan).</p>\r\n\r\n<p>Hadiah dari setiap pembelian :</p>\r\n\r\n<ol>\r\n	<li>Kategori kemasan KG/Liter : Kopi 5 pcs</li>\r\n	<li>Kategori kemasan Galon : Mug</li>\r\n	<li>Kategori kemasan Pail : Sarung, kaos, minyak goreng (salah satu)&nbsp;</li>\r\n</ol>\r\n\r\n<p>makin banyak kan keuntungan yang bisa kalian dapetin di citra warna, sudah menjamin harga termurah, dapet hadiah pula jika berbelanja cat di citra warna Tibubeneng&nbsp;, untuk warga sekitar masih yakin mau beli cat di toko lain ?</p>\r\n', 1, '166666666666-01.jpg', 1, 37),
(26, '2018-05-15 09:06:35', 'Beli Cat Gratis Tiket Nonton Bali United', 'beli-cat-gratis-tiket-nonton-bali-united', 'beli cat dapet tiket, bali united, tiket bali united', 'Hallooo Sahabat CWA, siapa disini yang ngefans sama tim sepak bola Bali United? Pengen nonton pertandingan Bali United Secara gratis?  Kalau iya, kami akan memberikan tiket nonton pertandingan Bali United secara gratis tiap pembelian produk Indaco seperti', '<p>Hallooo Sahabat CWA, siapa disini&nbsp;yang ngefans sama tim sepak bola Bali United? Pengen nonton pertandingan Bali United Secara gratis?&nbsp; Kalau iya, kami akan memberikan tiket nonton pertandingan Bali United secara gratis tiap pembelian produk Indaco seperti Envi, Belazo, Modacon dan sebagainya, dengan minimal nominal Rp. 750.000..</p>\r\n\r\n<p>Lumayan kan? kapan lagi bisa beli cat terus dapet tiket nonton sepak bola gratis? Ditambah toko kami selalu menyediakan cat yang berkualitas dan harga termurah. Oh iya promo ini&nbsp;berlaku di seluruh cabang toko kami yaa..</p>\r\n\r\n<p>Makin banyak kan keuntungan untuk beli cat di Citra Warna, masih yakin mau beli di toko lain ?&nbsp;&nbsp;</p>\r\n', 1, 'promo_BUSISE-01.jpg', 0, 5),
(27, '2018-05-10 09:09:26', 'Promo Grand Opening CW15 Singaraja', 'promo-grand-opening-cw15-singaraja', 'cw15, toko cat singaraja, cw singaraja, citra warna singaraja', 'Hallo sahabat CWA, kali ini akan kami sampaikan promo menarik tiap pembelian di toko kami yang beralamat di Singaraja, promo ini berlaku selama persediaan hadiah masih ada, jadi ayo buruan beli cat di Citra Warna Singaraja sebelum kehabisan.', '<p>Hallo sahabat&nbsp;CWA, kali ini akan&nbsp;kami sampaikan promo menarik tiap pembelian di toko kami yang beralamat di Singaraja, promo ini berlaku selama persediaan hadiah masih ada, jadi ayo buruan beli cat di Citra Warna Singaraja sebelum kehabisan.</p>\r\n\r\n<p>Ketentuan dan syaratnya sebagai berikut :&nbsp;</p>\r\n\r\n<p>- Setiap pembelian cat dalam kemasan KG/Liter, Galon dan Pail dalam 1 nota (berlaku untuk semua produk cat), pelanggan berhak mendapatkan 1 buah hadiah yang telah disiapkan sesuai kategori (tidak berlaku kelipatan).</p>\r\n\r\n<p>Hadiah dari setiap pembelian :</p>\r\n\r\n<ol>\r\n	<li>Kategori kemasan KG/Liter : Kopi 5 pcs</li>\r\n	<li>Kategori kemasan Galon : Mug</li>\r\n	<li>Kategori kemasan Pail : Sarung, kaos, minyak goreng (salah satu)&nbsp;</li>\r\n</ol>\r\n\r\n<p>Gimana, banyak bukan keunggulan beli cat di citra warna, selain harga termurah kami juga memberikan hadiah dari tiap pembelian cat dalam kemasan apa saja, jadi tunggu apalagi? ayo beli cat di Citra Warna Singaraja.</p>\r\n', 1, 'promocw15_.jpg', 0, 1),
(28, '2018-05-10 09:19:07', 'Segera dibuka Toko Cat Citra Warna 16 Tibubeneng', 'segera-dibuka-toko-cat-citra-warna-16-tibubeneng', 'cw16, cw tibubeneng', 'Halloo sahabat CWA, bagaimana kabar kalian semua, baik-baik saja bukan? Setelah beberapa waktu yang lalu mimin posting tentang berita segera dibuka Toko Cat Citra Warna 15 Singaraja, kali ini mimin akan memberi tau lagi ke kalian pada bulan mei ini toko k', '<p>Halloo sahabat&nbsp;CWA, bagaimana kabar kalian semua, baik-baik saja bukan? Setelah beberapa waktu yang lalu mimin posting tentang berita segera dibuka Toko Cat Citra Warna 15 Singaraja, kali ini mimin akan memberi tau lagi ke kalian pada bulan mei ini&nbsp;toko kami akan membuka cabang yang ke 16 di daerah Tibubeneng Badung.</p>\r\n\r\n<p>Diawal tahun 2018 ini Citra Warna membuka 3 toko yakni CW14 Dalung, CW15(Singaraja), CW16(Tibubeneng), dengan demikian Citra Warna akan terus berkembang dan selalu meningkatkan pelayanan kepada masyarakat.&nbsp;</p>\r\n\r\n<p>Pastinya banyak keuntungan dengan berbelanja keperluan pengecatan di Citra Warna, seperti jaminan harga termurah, produk lengkap dan delivery service yang belum tentu keuntungan tersebut anda dapatkan di toko lain.</p>\r\n\r\n<p>Jadi tunggu apa lagi, ayo beli cat di Citra Warna~</p>\r\n', 1, 'SOON_CW_15_TIBUBENENG.jpg', 1, 4),
(29, '2018-04-20 09:19:53', 'Segera dibuka Toko Cat Citra Warna 15 Singaraja', 'segera-dibuka-toko-cat-citra-warna-15-singaraja', 'cw15, toko cat singaraja, cw singaraja, citra warna singaraja', 'Helloo sahabat CWA, setalah bulan kemarin kami sudah sukses membuka cabang 14 yang ada di Dalung, sebentar lagi kami akan membuka toko cabang lagi di daerah Singaraja tepatnya di jalan A Yani no. 194 A Banyuasri - Singaraja, akan ada promo dan hadiah mena', '<p>Helloo sahabat CWA, setalah bulan kemarin kami sudah sukses membuka cabang 14 yang ada di Dalung, sebentar lagi kami akan membuka toko cabang lagi di daerah Singaraja tepatnya di jalan A Yani no. 194 A Banyuasri - Singaraja, akan ada promo dan hadiah menarik tiap pembelian di toko tersebut.</p>\r\n\r\n<p>Bagi yang belum tau, Toko Cat Citra Warna adalah toko cat terbesar di Bali yang memiliki banyak cabang di Daerah Denpasar dan sekitarnya, Toko Cat Citra Warna selalu menjamin harga termurah serta jaminan kelengkapan produk untuk segala keperluan pengacatan anda, Toko kami juga menyediakan delivery service serta melayani pembelian dalam partai besar maupun kecil.&nbsp;</p>\r\n\r\n<p>Sudah jelas keuntungan-keuntungan tersebut tidak akan kalian dapatkan di toko lain, jadi tunggu apa lagi warga Singaraja dan sekitarnya? Ayooo beli cat di Toko Cat Citra Warna~</p>\r\n', 1, 'BROSEGERAANEW.jpg', 1, 1),
(30, '2018-04-20 09:21:50', 'Promo Grand Opening CW14 Dalung', 'promo-grand-opening-cw14-dalung', 'cw14 dalung, citra warna dalung', 'Halloo sahabat CWA, setelah kabar gembira mengenai telah dibukanya cabang CW14 yg ada di Dalung, kami akan juga akan memberikan promo setiap pembelian cat tembok dengan ketentuan sebagai berikut : ', '<p>Halloo sahabat CWA, setelah kabar gembira mengenai telah dibukanya cabang CW14 yg ada di Dalung, kami akan juga akan memberikan promo setiap pembelian cat tembok dengan ketentuan sebagai berikut :&nbsp;</p>\r\n\r\n<p>- Setiap pembelian cat dalam kemasan KG/Liter, Galon dan Pail dalam 1 nota (berlaku untuk semua produk cat), pelanggan berhak mendapatkan 1 buah hadiah yang telah disiapkan sesuai kategori (tidak berlaku kelipatan).</p>\r\n\r\n<p>- Promo ini berlaku selama persediaan hadiah masih ada, berikut list dari hadiah pembelian cat dalam kemasan :&nbsp;</p>\r\n\r\n<ol>\r\n	<li>Kategori kemasan KG/Liter : Kopi 5 pcs</li>\r\n	<li>Kategori kemasan Galon : Mug</li>\r\n	<li>Kategori kemasan Pail : Sarung, kaos, minyak goreng (salah satu)&nbsp;</li>\r\n</ol>\r\n\r\n<p>Gimana, banyak bukan keuntungan beli cat di Toko Cat Citra Warna Dalung? Jadi tunggu apa lagi, ayoo dapatkan segala kebutuhan cat anda di Toko Cat Citra Warna cabang Dalung, dan dapatkan hadiah menarik setiap pembelian cat dalam kemasan apa saja.&nbsp;</p>\r\n', 1, 'telah_dibuka_revisi.jpg', 1, 4),
(31, '2018-04-04 09:23:46', 'Telah dibuka Citra Warna ke 14 Cabang Dalung', 'telah-dibuka-citra-warna-ke-14-cabang-dalung', 'cw14 dalung, citra warna dalung', 'Hallo semua, ada kabar baik nih untuk kita semua khususnya yang tinggal di daerah Dalung kecamatan Kuta Utara, kabupaten Badung, Bali. ', '<p>Hallo semua, ada kabar&nbsp;baik&nbsp;nih untuk kita semua khususnya yang tinggal di daerah Dalung kecamatan&nbsp;Kuta Utara, kabupaten Badung, Bali.&nbsp;</p>\r\n\r\n<p>Kini Toko Cat Citra Warna telah membuka cabang yang ke 14 yang beralamat di&nbsp;Jalan Raya Padang Luwih Pertokoan Sutra Mas, Kav A8, Dalung-Kuta Utara, Badung Bali.&nbsp;</p>\r\n\r\n<p>Seperti biasa Toko Cat Citra Warna selalu menjamin harga termurah, produk berkualitas dan kelengkapan produk serta pelayanan yang tidak dimiliki toko cat lainnya adalah kami memiliki layanan pengecekan kesiapan gratis tembok khusus di daerah Denpasar, tidak hanya itu berikut keuntungan berbelanja cat di Toko Cat Citra Warna :</p>\r\n\r\n<ul>\r\n	<li>Jaminan harga termurah, apabila customer mendapatkan harga cat yang lebih murah dari kami, kami akan ganti selisihnya (syarat dan ketentuan berlaku)</li>\r\n	<li>Produk terlengkap, segala kebutuhan pengecatan anda ada disini</li>\r\n	<li>Delivery Service, kami juga memiliki jasa antar barang ke lokasi anda.</li>\r\n	<li>Melayani pembelian partai kecil maupun partai besar, yang berarti pembelian 1 KG maupun 10 Pail tetap kami layani dengan baik.</li>\r\n</ul>\r\n\r\n<p>Jadi tunggu apa lagi warga dalung dan sekitarnya? Ayo beli cat di Toko Cat Citra Warna Cabang Dalung, Tepatnya di Jalan Raya Padang Luwih Pertokoan Sutra Mas, Kav A8, Dalung-Kuta Utara, Badung Bali. No Tlp : 0361-428939, 082235015265 dan 0895410917930</p>\r\n', 1, 'dalung.jpg', 1, 0),
