(37, '2018-08-29 10:57:29', 'awdawdaw', 'awdawdaw', 'awdawdaw', 'awdawdawdawd', '<p>Antara/Jakarta &nbsp;</p>\r\n\r\n<p>The Japan baseball team trounced Thailand in the 2018 Asian Games men&rsquo;s baseball competition with an overpowering score of 24-0 in the Baseball Stadium, Jakarta, on Tuesday.<br />\r\nJapan scored 4-0 in the first inning. In the second inning Japan scored four more.&nbsp;</p>\r\n\r\n<p>Japan continued to prevail in the third inning, increasing the lead to 13-0. Later the scoreboard displayed three additional points in favor of Japan (16-0).<br />\r\nThe fourth inning again saw a Japan scoring spree with eight more points, making the standing 24-0. By the mercy rule, the fourth inning ended the game at that point.<br />\r\nJapan tops Group A and is through to the next round. Thailand finished at the bottom of Group A under Pakistan.</p>\r\n\r\n<p><img alt="" class="img-fluid" src="/citrawarna/assets/ckeditor/kcfinder/upload/images/envi%20roof%20new.png" /></p>\r\n\r\n<p>Thailand did not win in the second round of the men&rsquo;s baseball in the 2018 Asian Games. China ranks second after Japan with two wins and one loss.&nbsp;<br />\r\nReporter: Afut Syafril Nursyirwan<br />\r\nEditor: AA Ariwibowo</p>\r\n\r\n<p>AG Media and PR in cooperation with&nbsp;<em>The Jakarta Post</em></p>\r\n', 1, '2018_05_04-1.jpg', 1, 4);
INSERT INTO `barang` (`id_barang`, `kd_merk`, `nm_barang`, `deskripsi`, `kd_kategori`, `kd_jenis`, `tag`, `foto`, `no_index`, `stat`, `unggulan`, `click`) VALUES
(1, 'WLDN', 'Weldon Wallpaint', 'Weldon Wallpaint adalah cat tembok Acrylic Emulsion yang diformulasikan untuk pengecatan dalam ruangan dengan perpaduan warna – warna yang menarik sehingga menghadirkan keindahan dan kenyamanan.', 1, 1, 'Weldon, cat tembok, cat weldon', 'weldon.jpg', 1, 1, 'y', 359),
(6, 'IDCEV', 'Envi Wall Paint', 'Envi adalah cat tembok sehat dengan bahan yang ramah lingkungan. Sangat cocok untuk orang yang tidak suka bau cat yang menyengat.', 1, 1, 'harum, tak berbau, dalam rumah, interior, envi', 'envi_baru.jpg', 2, 1, 'y', 115),
(7, 'PLDN_G', 'Paladin Gold', 'Paladin Gold adalah cat tembok eksterior kelas premium yang memberikan hasil dan perlindungan maksimal untuk tembok luar ruangan anda.', 1, 2, 'paladin gold, cat tembok eksterior, premium', 'Paladin_Gold.jpg', 4, 1, 'y', 17),
(8, 'IDCRP', 'Envi Roof Paint', 'Envi Roof Paint adalah cat genteng serba guna berbahan dasar 100% akrilik yang dapat digunakan untuk segala jenis permukaan genteng, tembok, asbes, eternit, plafon, lapangan tenis, marka jalan serta lantai gudang.', 5, 2, 'envi roof, envi cat genteng, envi', 'enviroof.jpg', 5, 1, 'y', 110),
(10, 'NPNP', 'Nippe 2000', 'Nippe 2000 adalah cat duco yang sangat cocok untuk kendaraan, seperti mobil, motor dan lain lain, juga bisa diaplikasikan pada besi. Memiliki hasil yang maksimal dengan pilihan warna yang unik,', 3, 0, 'cat duco, nippe 2000, jual nippe 2000', 'nippe.jpg', 3, 1, 'n', 14),
(11, 'PLDN_V', 'Paladin Silver', 'Paladin Silver adalah cat tembok interior kelas premium yang memberi perlindungan maksimal untuk tembok dalam ruangan Anda.', 1, 1, 'paladin, cat paladin, paladin silver', '1329Paladin_silver.jpg', 4, 1, 'y', 9),
(12, 'BLZOCLI', 'Belazo Climagard', 'Belazo Climagard adalah cat tembok eksterior kelas premium yang sangat baik untuk digunakan pada tembok anda, memiliki daya tahan yang lebih lama dan bau yang tidak menyengat. Kami menjual segala jenis warna Belazo Climagard dengan mesin tinting. ', 1, 2, 'belazo, belazo climagard, belazo cat,, belazo ekst', 'climagard.jpg', 5, 1, 'y', 15),
(13, 'BLZOMAX', 'Belazo Maxima', 'Kami menjual segala jenis warna Belazo Climagard dengan mesin tinting dengan harga yang bervariatif. ', 1, 1, 'belazo maxima, belazo interior, belazo cat, belazo', 'maxima.jpg', 0, 1, 'y', 17),
(14, 'IDCTSL', 'Top Seal', 'TOP SEAL adalah pelapis anti alkali dan anti bocor yang memiliki sifat elastis, kedap air serta tahan cuaca sehingga sangat cocok digunakan pada permukaan tembok, beton, asbes, galvanis/seng, dan permukaan terakota.', 7, 0, 'top seal, cat waterproofing, indaco waterproofing,', 'top_seal_galon.jpg', 6, 1, 'y', 42),
(15, 'NPVN', 'Vinilex ', 'NIPPON VINILEX adalah cat serbaguna yang dapat digunakan untuk dinding interior dan eksterior serta langit-langit berbahan dasar asbes, batako, beton, papan, mortar dan lain sebagainya baik yang baru atau yang sudah pernah di cat.', 1, 1, 'cat tembok, vinilex, cat vinilex', 'Vinilex.jpg', 7, 1, 'n', 3),
(16, 'AVAN', 'Avian ', 'Cat Avian adalah cat minyak dengan berbagai ukuran untuk mengecat kayu dan besi dengan pilihan warna yang menarik.', 2, 0, 'cat besi, cat kayu, cat kayu besi, avian cat kayu', 'avian.jpg', 8, 1, 'n', 8),
(17, 'BLZOWS', 'Belazo Wood Stain', 'Belazo Woodstain - Green Wood Coating adalah pelapis kayu 100% akrilik berbahan dasar air dengan kandungan pigmen oksida transparan. Melapisi permukaan kayu dengan lapisan bening khusus sehingga keindahan serat kayu tetap terjaga dan terkesan alami. Dapat digunakan untuk interior dan eksterior', 8, 0, 'belazo wood stain, belazo ws, cat politur', 'BELAZO_WOODSTAIN_-_1_LITER.jpg', 3, 1, 'y', 13),
(19, 'OXYGN', 'Oxygen ', 'Oxygen adalah cat spray serbaguna dengan warna yang menarik, dan harga yang terjangkau.', 46, 0, 'oxygen, cat semprot, cat spray, oxygen paint', 'Oxygen.jpg', 6, 1, 'y', 3),
(20, 'WLS', 'Welstone', 'WelStone dapat masuk kedalam pori-pori substrat dan membentuk lapisan yang melekat kuat, tahan terhadap perubahan cuaca dan mencegah timbulnya jamur dan lumut,dengan demikian batu terlindungi dan memiliki tampilan yang indah, mengkilap, dan menonjolkan warna serta tekstur alami batu.', 42, 0, 'welstone, cat batu, cat batu alam', '1408Welstone_Ok.jpg', 8, 1, 'y', 7),
(21, 'SPEEDY', 'Speedy', 'Thinner Speedy adalah thinner berkualitas serbaguna yang berguna sebagai pengencer segala jenis cat.', 4, 0, 'thinner, thinner speedy, speedy thinner', 'Speedy-600x600.jpg', 7, 1, 'n', 8),
(22, 'XXTIKA', 'Kuas Tika', 'Kuas Tika adalah kuas dengan kualitas yang sangat baik', 43, 0, 'kuas tika, kuas, tika kuas', 'Tika_4-600x600.jpg', 7, 1, 'y', 17),
(23, 'CTTD', 'Dulux Catylac', 'Cat Tembok Catylac adalah cat tembok dengan pilihan warna yang menarik untuk menghiasi interior rumah.', 1, 1, 'catylac, catylac cat tembok, cat tembok interior', 'catylac_galon.jpg', 9, 1, 'n', 14),
(24, 'DLPT', 'Dulux Pentalite', 'Dulux Pentalite adalah cat tembok interior kelas Premium dengan hasil yang maksimal. Note: harga diatas adalah harga untuk warna umum. Harga Dulux Pentalite warna khusus bisa lebih mahal.', 1, 1, 'pentalite, dulux pentalite, cat pentalite ', 'pentalite.jpg', 11, 1, 'n', 20),
(25, 'DLWP', 'Dulux Weathershield', 'Dulux weathershield adalah cat tembok kelas premium dengan kualitas yang sangat baik untuk dinding eksterior anda serta tahan dari segala cuaca', 1, 2, 'dulux, dulux weathershield', 'wts.jpg', 12, 1, 'n', 7),
(26, 'MWEM', 'Mowilex ', 'Mowilex Emulsion Standard adalah cat tembok kelas premium yang memberikan hasil tembok yang kuat dan maksimal untuk Interior ruangan.\r\nBagikan produk ini :', 1, 1, 'mowilex, cat tembok, mowilex emulsion', 'mowilek_galon.jpg', 12, 1, 'n', 6),
(27, 'MMMW', 'Mawar', 'Cat tembok Mawar adalah cat tembok interior berkualitas dengan harga yang terjangkau.', 1, 1, 'mawar, mawar cat tembok', 'Mawar.jpg', 14, 1, 'n', 8),
(28, 'NPPX', 'Pylox', 'Pylox adalah cat spray serbaguna yang bisa digunakan untuk berbagai jenis media.', 46, 0, 'pylox, cat pylox, jual cat pylox', 'pylox.jpg', 19, 1, 'n', 3),
(29, 'BLZOKZD', 'Belazo Kidzdream', 'Belazo Kidzdream - Easy Wash adalah cat tembok interior bagi Anda yang mendukung dan mengembangkan kreasi anak tanpa harus khawatir tembok akan kotor. Dengan Stain Proof Anti Graffiti Technology, terbukti mampu menahan noda seperti kopi, teh, krayon, lumpur, debu dan noda lainnya yang tidak meresap dalam lapisan cat, sehingga dapat dibersihkan tanpa merusak lapisan cat.', 1, 1, 'belazo, belazo kidzdream, jual belazo kidzdream', 'BELAZO_KIDZDREAM_-_2,5_LITER.jpg', 4, 1, 'y', 4),
(30, 'IDCALK', 'Envi Alkali Sealer', 'Envi Alkali Sealer adalah cat dasar berkualitas yang sangat bermanfaat untuk mempersiapkan pori-pori permukaan tembok sehingga pemakaian cat tembok menjadi lebih hemat, tampilan warna lebih cerah, dan hasil cat akhir menjadi lebih tahan terhadap serangan alkali terutama pada permukaan tembok baru baik di dalam maupun di luar ruangan.', 43, 0, 'envi alkali, envi cat dasar, jual cat dasar envi, ', 'envi_alkali.jpg', 5, 1, 'y', 6),
(31, 'IDCWF', 'Envi Wall Putty', 'Envi Wall Putty adalah lapisan dasar akrilik berwarna putih dengan fungsi utama untuk menutup pori – pori tembok sehingga menghasilkan permukaan tembok yang rata dan halus setelah pengecatan.', 43, 0, 'envi wallputy, ', 'Envi_Wall_Putty(1).jpg', 10, 1, 'y', 41),
(32, 'BLZORP', 'Belazo Roof Paint', 'Belazo Roof Paint - Elastomeric Finish adalah cat genteng premium berbahan dasar air untuk melindungi dan memperindah atap rumah anda. Dengan Elastomeric Formula dan bahan pewarna anti UV yang dibuat khusus untuk menahan sinar matahari, mencegah retak rambut penyebab kebocoran, melindungi dari pertumbuhan jamur dan lumut. Hasil akhir yang mengkilap serta dapat diaplikasikan pada media genteng, tembok, seng, besi dan baja. Belazo Roof Paint tanpa timbal dan merkuri serta rendah VOC, bau dan toksisitas.', 5, 2, 'belazo, jual belazo, belazo cat genteng, belazo ro', 'roofpaint.jpg', 6, 1, 'y', 11),
(33, 'BLZOAG', 'Belazo AGE', 'Belazo A.G.E - Water Based Masonry Finish adalah cat besi, kayu dan beton yang terbuat dari 100% akrilik khusus untuk menyempurnakan nilai estetika furniture, mainan anak-anak, kusen jendela dan pintu pagar luar yang terbuat dari besi, kayu dan beton. Formulanya telah lulus berbagai uji kualitas dan memperoleh sertifikat Singapore Green Label, sehingga aman bagi lingkungan bahkan untuk mainan anak-anak.', 2, 0, 'belazo, jual belazo, belazo cat age', 'age(16).jpg', 9, 1, 'y', 2),
(34, 'BLZOWF', 'Belazo Wood Filler', 'Belazo Wood Filler adalah lapisan dasar untuk menutup pori-pori kayu sehingga permukaan kayu rata dan halus, serta siap untuk proses Wood Finishing untuk hasil yang lebih indah. Dengan Water Based Formula yang bebas racun dan bau sehingga aman untuk lingkungan dan proses pengerjaannya', 43, 0, 'belazo wood filler, woodfiller, jual belazo wood f', 'BELAZO_WOOD_FILLER_-_1_KG.jpg', 7, 1, 'y', 1),
(35, 'BLZOAL', 'Belazo Alkali Sealer', 'Belazo Alkali Sealer - Water Based Alkali Sealer adalah cat dasar premium berbahan dasar air dengan perlindungan ganda terhadap serangan garam - garam alkali pada permukaan tembok baru, batu bata, plester dan asbes di dalam maupun di luar ruangan.', 43, 0, 'belazo alkali, jual belazo alkali sealer', 'alkali_sealer.jpg', 8, 1, 'y', 1),
(36, 'BLZOGNT', 'Belazo Graniteur', 'Belazo Graniteur - Granite Style Finish adalah cat spesial efek batu granit (cat tekstur) berbahan dasar air 1 (satu) komponen yang sangat praktis untuk menambah keindahan dan nilai artistik ruangan interior dan eksterior. Aplikasi yang mudah dan dapat diaplikasikan pada media tembok, besi ataupun kayu.', 1, 0, 'belazo graniteur', 'BELAZO_GRANITEUR_-_2,5_LITER.jpg', 6, 1, 'y', 3),
(37, 'BLZOWG', 'Belazo Woodgrano', 'Belazo Woodgrano - Wooden Style Finish adalah cat spesial efek kayu berbahan dasar air 1 (satu) komponen yang sangat praktis untuk menambah keindahan dan nilai artistik bidang interior atau eksterior.', 43, 0, 'belazo woodgrano, jual belazo wood grano', 'BELAZO_WOODGRANO_-_1_LITER.jpg', 22, 1, 'y', 8),
(38, 'IDCEVL', 'Envi Alkyd Synthetic Enamel ', 'Envi Alkyd Synthetic Enamel adalah cat alkyd sintetik bermutu tinggi yang memberikan perlindungan sekaligus keindahan pada permukaan kayu, logam dan berbagai konstruksi besi di luar ruangan maupun dalam ruangan', 2, 0, 'envilux, envi alkyd synthetic enamel, jual envilux', 'ENVI_ALKYD_SYNTHETIC_ENAMEL_-_0,9_LITER.jpg', 17, 1, 'y', 3),
(39, 'IDCZNP', 'Envi Anti Corrosive Primer', 'Envi Anti Corrosive Primer adalah cat dasar alkyd sintetik bermutu tinggi yang mengandung pigment anti karat dengan ketahanan cuaca yang tinggi.', 43, 0, 'envilux zinc, envi anti corrosive', 'Anti_corrosive.jpg', 12, 1, 'y', 6),
(40, 'IDCNSX', 'Nusatex Meni Kayu', 'NUSATEX Meni Kayu adalah cat dasar sintetik bermutu tinggi untuk melapisi berbagai jenis permukaan kayu. Agar mendapatkan hasil maksimal dari pengecatan kayu dengan cat sintetik, gunakan selalu satu lapis NUSATEX Meni Kayu sebagai cat dasar.', 43, 0, 'nusatex, nusatex meni kayu, nusatex cat dasar', 'Nusatex(3).jpg', 18, 1, 'y', 7),
(41, 'IDCMDC', 'Modacon Acian Semen Anti Alkali', 'Modacon Acian Semen Anti Alkali adalah Acian instan premium berwarna abu – abu muda dengan fungsi meratakan, menghaluskan permukaan beton dan plester sebelum tahap pengecatan atau pemasangan wallpaper.', 43, 0, 'modacon, modacon acian, jual modacon', '2(63).jpg', 14, 1, 'y', 12),
(42, 'IDCMDCW', 'Modacon Waterproofing', 'Modacon Waterproofing 2 K ( Cement Base ) adalah Semen instan sebagai bahan pelapis kedap air 2 komponen berbahan dasar semen dengan polimer binder sebagai penguatnya.', 43, 0, 'modacon waterproofing, modacon, jual modacon water', '3(56).jpg', 20, 1, 'y', 15),
(43, 'PLALK', 'Paladin Alkali Premium ', 'Alkali Premium mampu menahan dan melindungi cat tembok dari garam alkali tembok sehingga menghasilkan permukaan dan warna yang merata serta lebih tahan lama.', 43, 0, 'Paladin alkali premium, paladin alkali, paladin ', '7708Paladin_Alkali_PRemium.jpg', 20, 1, 'y', 3),
(44, 'WX', 'Weldon Eksterior', 'Weldon Exterior adalah cat tembok Acrylic Emulsion berkualitas yang mempunyai lapisan film yang keras, daya tutup maksimal dan dapat digunakan untuk Interior dan Eksterior.', 1, 2, 'weldon eksterior, cat eksterior, cat exterior', '3915Weldon_Ext.jpg', 21, 1, 'y', 5),
(45, 'WALK', 'Weldon Alkali Sealer', 'Weldon Alkali Sealer adalah lapisan dasar yang diformulasikan untuk menahan garam alkali pada tembok sehingga pada saat dilapisi cat tembok akan menghasilkan permukaan dan warna yang rata serta lebih tahan lama.', 43, 0, 'weldon, weldon alkali sealer, cat alkali sealer', '3027Weldon_Alkali_Sealer.jpg', 23, 1, 'y', 0),
(46, 'WPR', 'Weldon Wood Prime', 'Weldon Wood Primer adalah cat dasar untuk kayu berbahan dasar air sebagai pengganti cat duco dengan kelebihan daya tutup bagus dan amplasan yang mudah.', 3, 0, 'weldon wood primer, jual weldon, cat weldon', '8568Weldon_Prime.jpg', 24, 1, 'y', 8),
(47, 'WPLR', 'Pillar Plamur', 'Pillar Plamur adalah dempul tembok untuk meratakan permukaan tembok yang retak atau bergelombang.\r\nKelebihan Produk : Mudah Diaplikasikan, Mudah Diamplas', 43, 0, 'pillar, pillar plamur, jual pillar plamur', '7458PILLAR_Plamir.jpg', 25, 1, 'y', 3),
(48, 'WLPLRCT', 'Pillar Cat Tembok', 'Pillar Wallpaint adalah Cat tembok ekonomis yang tidak ngapur dan daya tutup bagus. Pillar Wallpaint cocok digunakan untuk tembok, asbes, gypsum dan triplek.', 1, 0, 'Pillar cat tembok , pillar wall paint', '577PILLAR_wp.jpg', 26, 1, 'y', 10),
(49, 'ACAP', 'Aquaproof', 'Aquaproof adalah cat tembok sekaligus anti air (Waterproof) yang tahan terhadap segala cuaca.', 7, 0, 'aquaproof, jual aquaproof, cat aquaproof', 'produk_4kg.jpg', 27, 1, 'n', 5),
(50, 'AVND', 'No Drop', 'No Drop adalah cat tembok sekaligus anti air. Cocok untuk mengatasi tembok yang lembab dan bocor.', 7, 0, 'no drop, jual no drop, cat no drop', 'nd.jpg', 28, 1, 'n', 1),
(51, 'NSTN', 'Thinner Nissan', 'Thinner Nissan adalah pengencer serbaguna yang berfungsi mengencerkan cat.', 4, 0, 'thinner nissan, jual thinner nissan, harga thinner', 'nissan.jpg', 29, 1, 'n', 0),
(52, 'RSAR', 'Arca', 'Arca adalah cat batu yang tersedia dalam jenis Doff Natural, Black Natural, Transparan, Gloss Natural, Green Gloss, dan Black Gloss.', 42, 0, 'arca, jual arca, cat batu arca, harga cat arca', 'arca.jpg', 30, 1, 'n', 3),
(53, 'MWWS', 'Mowilex Woodstain', 'Mowilex Woodstain adalah cat politur berkualitas. Dapatkan Mowilex Woodstain termurah hanya di Citra Warna', 8, 0, 'mowilex woodstain, jual mowilex woodstain, harga m', 'MOWILEX-Woodstain.jpg', 31, 1, 'n', 2),
(54, 'ULLZ', 'Ultran Lasur EL-501 ', 'ULTRAN LASUR EL-501 adalah pelindung kayu yang memiliki daya penetrasi kuat ke dalam pori-pori kayu yang memberikan perlindungan terhadap cuaca dan mampu menampilkan keindahan serat alami kayu.', 8, 0, 'ultran lasur, propan lasur, jual lasur propan', 'el501.jpg', 32, 1, 'n', 3),
(55, 'ULDL', 'Ultran Deck Lasur EDL-601', 'Ultran Deck Lasur EDL-601 adalah rangkaian seri Ultran Lasur yang didisain khusus untuk lantai kayu exterior (deck). Produk ini meresap masuk ke dalam kayu sehingga meningkatkan stabilitas dimensi kayu, tahan cuaca dan gesekan, anti jamur, fleksibel serta tidak meninggalkan jejak kuas.', 0, 0, 'propan lasur, jual edl 601, ultran deck lasur, har', 'edl.jpg', 33, 1, 'n', 0),
(56, 'ULDL', 'Ultran Deck Lasur EDL-601', 'Ultran Deck Lasur EDL-601 adalah rangkaian seri Ultran Lasur yang didisain khusus untuk lantai kayu exterior (deck). Produk ini meresap masuk ke dalam kayu sehingga meningkatkan stabilitas dimensi kayu, tahan cuaca dan gesekan, anti jamur, fleksibel serta tidak meninggalkan jejak kuas.', 8, 0, 'propan lasur, jual edl 601, ultran deck lasur, har', 'edl.jpg', 33, 1, 'n', 0),
(57, 'PRSC', 'Propan Stone Care', 'Propan Stone Care adalah pelapis batu alam yang terbuat dari bahan acrylic solvent based. PROPAN STONE CARE memberikan perlindungan maksimal pada batu alam serta menonjolkan keindahan corak batu alam sehingga menjadi lebih indah dan artistik.', 42, 0, 'propan cat batu, propan stone care, jual propan st', 'sc.jpg', 34, 1, 'n', 6),
(58, 'PRFW', 'Propan Furniture Wax', 'PROPAN FURNITURE WAX adalah produk perawatan kayu yang diformulasikan khusus untuk menampilkan keindahan serat kayu. Propan Furniture Wax diaplikasikan sebagai lapisan akhir dalam tahapan finishing kayu dan memiliki sifat water repelent (menolak air).', 8, 0, 'jual furniture wax, cat furniture wax, propan furn', 'furniture.jpg', 35, 1, 'n', 1),
(59, 'IMWF', 'Impra Wood Filler', 'Kayu tropis umumnya memiliki pori-pori yang cukup besar sehingga memerlukan wood filler berkualitas tinggi agar mampu mengisi pori-pori kayu dengan sempurna. IMPRA WOOD FILLER terbuat dari bahan dasar Nitrocellulose (NC) berkualitas tinggi sehingga cepat kering, mudah diamplas dan memiliki daya isi pori yang sangat baik dan tidak mudah terlepas pada saat proses pengamplasan.', 8, 0, 'impra wf, jual impra wood filler, harga impra ', 'impra.jpg', 36, 1, 'n', 7),
(60, 'IMNC', 'Impra NC System', 'IMPRA NITROCELLULOSE (NC) SYSTEM adalah bahan finishing 1 komponen (1K) dengan bahan dasar Nitrocellulose (NC) sehingga lebih praktis dan lebih cepat kering. Lapisan finishing IMPRA NC yang tipis sehingga tampak lebih natural, sangat tepat diaplikasikan untuk mebel dan interior bergaya antik dengan warna-warna coklat tua.', 8, 0, 'impra nc, jual impra nc, harga impra nc', 'nc.jpg', 37, 1, 'n', 1),
(61, 'IMML', 'Impra Melamine System', 'IMPRA MELAMINE SYSTEM  adalah sistem finishing kayu 2 komponen (2K) dengan bahan dasar Amino dan Alkyd. Berbeda dengan bahan finishing jenis melamik lainnya, IMPRA Melamine System didesain secara khusus sehingga rendah kandungan formaldehyde-nya (low formaldehyde) sehingga relatif tidak berbau pedas dan pedih di mata dan lambat menguning (low yellowing).', 8, 0, 'impra ml, jual impra ml, harga impra melamine', 'impra-ml.jpg', 38, 1, 'n', 2),
(62, 'IMWS', 'Impra Wood Stain WS-162 B', 'IMPRA WOOD STAIN WS-162 B merupakan pewarna transparan berkualitas tinggi yang cocok digunakan untuk furniture / bagian dalam rumah (interior). ', 8, 0, 'Impra ws, impra wood stain, jual impra woodstain, ', 'impra-ws.jpg', 39, 1, 'n', 2),
(63, 'ULLZ', 'Ultra Lasur Laser EL-501 LS', 'ULTRAN LASUR LASER EL-501 LS adalah inovasi terbaru dari rangkaian seri ULTRAN LASUR yang memberikan perlindungan terhadap cuaca dan mampu menampilkan keindahan serat alami kayu secara lebih maksimal dari ULTRAN LASUR TRANSPARENT COLOR', 8, 0, 'ultran lasur, harga propan lasur ls, jual lasur pr', 'ls.jpg', 40, 1, 'n', 3),
(64, 'ULP1', 'Ultran Politur P-01', 'ULTRAN POLITUR P-01 adalah politur modern solvent based berkualitas tinggi yang dirancang agar mudah dalam aplikasi, cocok digunakan untuk melindungi dan menampilkan keindahan bagian-bagian dalam rumah (interior) yang terbuat dari kayu.', 8, 0, 'Politur, jual p01, cat politur p01, harga p01', 'ultran-politur-p-01_2017-02-04_14-41-05-17-ultran-politur-p-01png.jpg', 41, 1, 'n', 1),
(65, 'ULP3', 'Ultran Politur P-03 UV', 'ULTRAN POLITUR P-03 UV adalah cat politur solvent based dengan resin flexible alkyd yang memberi perlindungan ekstra terhadap sinar matahari, cuaca, serta serangan jamur dan serangga', 8, 0, 'ultran politur p03, jual ultran politur p03, harga', 'p03.jpg', 42, 1, 'n', 1),
(66, 'KCLL', 'Cat KCA', 'KCA adalah cat tekstur berkualitas yang dapat diaplikasikan pada tembok interior maupun eksterior', 1, 0, 'kca, jual cat kca, harga cat kca', 'kca.jpg', 43, 1, 'n', 3),
(67, 'WLPR', 'Welproof', 'Welproof adalah cat anti bocor yang di desain untuk mencegah kebocoran air dan retak rambut.\r\nWelproof memiliki sifat elastis, kedap air, daya rekat yang baik dan anti jamur.', 7, 0, 'welproof, jual welproof, harga welproof', 'welproof.jpg', 44, 1, 'y', 3),
(68, 'MTEM', 'Emco', 'Emco adalah cat yang dapat diaplikasikan pada besi dengan kualitas baik.', 2, 0, 'emco, jual emco, cat emco, harga emco', 'emco.jpg', 45, 1, 'n', 5),
(69, 'BASG', 'Penta Super Gloss', 'Penta Super Gloss NC Metalic adalah cat yang dibuat dari bahan dasar resin Nitrocellulose dan Alkyd yang berkualitas tinggi sehingga menghasilkan cat yang tahan lama dan cepat kering dan dapat digunakan untuk pemakaian interior dan exterior, cat mobil', 3, 0, 'penta, jual cat penta super gloss, harga penta sup', 'penta.jpg', 46, 1, 'n', 1),
(70, 'DNTP', 'Top Color', 'Top Color adalah cat mobil dengan bahan dasar nitrocellulose berkualitas primer sehingga Top Color memiliki daya tutup lebih luas tidak mudah retak karena benturan, cepat kering serta sangat mengkilap.', 3, 0, 'top color, jual top color, harga top color', 'DANA-PAINT-TOP-COLOR.jpg', 47, 1, 'n', 1),
(71, 'AGTH', 'Thinner Alfagloss', 'Thinner Alfagloss adalah thinner yang berguna untuk mengencerkan cat', 4, 0, 'thinner alfagloss, jual alfagloss, harga thinner a', 'alfagloss.jpg', 48, 1, 'n', 2),
(72, 'XXSR', 'Thinner Sakura', 'Thinner sakura adalah thinner pada umumnya yang berguna untuk mengencerkan cat', 4, 0, 'jual thinner sakura, harga thinner sakura', 'sakura.jpg', 49, 1, 'n', 0),
(73, 'XXTR', 'Tar Tar', 'Tartar adalah dempul tembok berkualitas yang berguna untuk menutup keretakan maupun kerusakan tembok sebelum dicat.', 43, 0, 'tar tar, jual tar tar, harga tar tar', 'tartar.jpg', 50, 1, 'n', 3);
