INSERT INTO `detail_barang` (`id_dtl`, `kd_merk`, `detail_teks`, `cc`, `stat`) VALUES
(2, 'WLDN', '<p><strong>WELDON WALLPAINT</strong></p>\r\n\r\n<p>Diilhami dari indahnya warna warni dunia, kami hadirkan sebuah produk yang berbasis styrene acrylic yang mempunyai keunggulan tahan dengan semua iklim sangat sesuai dengan daerah tropis dengan hasil yang sempurna.<br />\r\nWeldon sangat cocok diaplikasikan di berbagai segala permukaan tembok dan plafond rumah anda. Tersedia dengan beragam warna yang anggun dan indah,memberikan keleluasaan bagi anda untuk mengeksplorasi rumah anda yang sesuai dengan cita rasa dan keinginan anda.</p>\r\n\r\n<p>Data Teknis :</p>\r\n\r\n<ul>\r\n	<li>Kering sentuh : 1jam</li>\r\n	<li>Kering sempurna : 24 jam(untuk hsil paling maksimal)</li>\r\n	<li>Interval pemakaian :1jam</li>\r\n	<li>Standar ketebalan : 25 micron</li>\r\n	<li>Ketebalan yang dianjurkan : 50-75micron(2-3 lapis)</li>\r\n	<li>Daya sebar 5-7m2/meter</li>\r\n	<li>Pelarut:air bersih</li>\r\n	<li>Aplikasi : kuas,roll,semprot</li>\r\n	<li>Kemasan : 1kg, 5kg dan 25kg</li>\r\n</ul>\r\n\r\n<p>Cat tembok WELDON membantu menghadirkan keindahan pada interior dan exterior rumah Anda dengan warna-warni cantik untuk memberi sentuhan pribadi pada dekorasi interior dan exterior rumah Anda.</p>\r\n\r\n<p><strong>CARA PENGGUNAAN</strong></p>\r\n\r\n<p>Permukaan yang sudah dicat sebelumnya perlu dipersiapkan terlebih dahulu dengan baik.</p>\r\n\r\n<p><strong>PERMUKAAN BARU</strong></p>\r\n\r\n<p>Untuk hasil terbaik bagi permukaan tembok baru, beton ataupun permukaan lainnya, sebaiknya pastikan tembok benar-benar kering sebelum pengecatan, bukan kering sentuh/kering permukaan (pengukuran protimeter berkisar 17-19% dengan PH &lt;9 ).</p>\r\n\r\n<p><strong>PENGECETAN ULANG</strong></p>\r\n\r\n<p>Kerok semua bagian cat lama yang terkelupas, debu &amp; kotoran lainnya sebelum melakukan pengecatan. Amplas permukaan sampai halus. Bila mana diperlukan bilas permukaan tembok untuk menghilangkan kotoran, debu &amp; minyak.</p>\r\n', '', 1),
(9, 'IDCEV', '<p><strong>Petunjuk pemakaian :</strong>&nbsp;Permukaan yang akan dicat perlu diampelas dan dibersihkan dahulu dengan baik. Supaya mendapatkan hasil akhir yang baik dan awet bagi permukaan tembok, beton, atau permukaan lainnya, sebaiknya diberikan waktu pengeringan secukupnya sebelum pengecatan. Untuk permukaan tembok baru sebaiknya diberikan waktu pengeringan semen minimal 1 bulan dengan kadar air maksimum 18% dan maksimum pH8. Untuk permukaan tembok lama, periksa dahulu daya rekat cat tembok yang lama. Jika diperlukan, lakukan pengerokan kemudian dibersihkan kembali.</p>\r\n\r\n<p><strong>Cara aplikasi :</strong>&nbsp;Dengan Kuas, Roll, Semprot</p>\r\n\r\n<p><strong>Keterangan produk :</strong>&nbsp;Masa pengeringan adalah 1-2 jam sebelum lapisan berikutnya, dengan daya sebar optimum 7-10 m2/kg per lapisan tergantung kondisi dan porositas permukaan. Pengenceran dengan air bersih sebanyak 30% untuk aplikasi dengan kuas atau roll dan 50% untuk aplikasi dengan semprot.</p>\r\n\r\n<p><strong>Tersedia dalam kemasan&nbsp;:</strong></p>\r\n\r\n<p>1Kg, 5Kg, dan 25Kg</p>\r\n', 'envi_latexs_cc.jpg', 1);
