(1, 'CTTB', 'Cat Tembok', 'Berikut adalah produk cat yang disarankan untuk diaplikasikan pada tembok bagian dalam (interior), maupun luar ruangan (eksterior).', 3),
(2, 'CLR', 'Cat Kayu Besi', 'Cat kayu besi adalah cat yang khusus digunakan untuk melapisi permukaan kayu / besi dengan pilihan warna yang menarik.', 6),
(3, 'CTDC', 'Cat Duco', 'Cat duco adalah cat yang khusus digunakan untuk melapisi kendaraan mobil / motor Anda. ', 7),
(4, 'THIN', 'Thinner', 'Thinner adalah cairan yang berguna untuk mengencerkan cat. Thinner dibedakan menjadi 2 jenis yang disesuaikan dengan  kebutuhan', 10),
(5, 'CTGT', 'Cat Genteng', 'Cat Genteng adalah cat yang digunakan untuk melapisi dan melindungi genteng maupun seng dari kerusakan akibat lumut, dan cuaca.', 5),
